INSERT INTO `email_template` VALUES (1, 'Bonjour #PRENOM #NOM\r\n\r\nNous vous remercions pour votre candidature que nous examinerons avec le plus grand soin. Si celle-ci correspond à nos attentes, nous ne manquerons pas de vous contacter prochainement. Sans réponse de notre part #DELAI, veuillez considérer que nous ne pouvons donner une suite favorable à votre candidature. Nous nous permettrons cependant de revenir vers vous si d’autres opportunités, en adéquation avec votre profil, se présentaient.\r\n\r\nAvec nos salutations distinguées,\r\n\r\nLa Direction des Ressources Humaines', 'Bonjour #PRENOM #NOM\r\n\r\nNous vous remercions pour votre candidature que nous examinerons avec le plus grand soin. Si celle-ci correspond à nos attentes, nous ne manquerons pas de vous contacter prochainement. Sans réponse de notre part #DELAI, veuillez considérer que nous ne pouvons donner une suite favorable à votre candidature. Nous nous permettrons cependant de revenir vers vous si d’autres opportunités, en adéquation avec votre profil, se présentaient.\r\n\r\nAvec nos salutations distinguées,\r\n\r\nLa Direction des Ressources Humaines');
