INSERT INTO `hiring_policy` VALUES ('3aabcac1900b37c1ce04abef5cb075f9.PNG', '<div align=\"justify\" style=\"font-family: &quot;Times New Roman&quot;; font-size: medium;\">« L\'intégration constitue un moment essentiel du parcours professionnel des nouveaux collaborateurs. Appréhender un nouvel environnement professionnel, découvrir les différentes activités de la Compagnie et les femmes et les hommes qui la composent, comprendre la culture d\'entreprise, sont autant d\'objectifs à atteindre pour une intégration réussie.<br><br>Pour y parvenir, nous avons mis en place au sein d\'ASL Airlines France :</div><ul style=\"font-family: &quot;Times New Roman&quot;; font-size: medium;\"><li><div align=\"justify\"><u>Un parcours d\'intégration</u>&nbsp;réalisé dès l\'arrivée d\'un nouveau salarié ;</div></li><li><div align=\"justify\"><u>Un book d\'intégration</u>&nbsp;est à la disposition de chaque nouvel arrivant. C\'est à la fois un livret d\'accueil et un guide pratique dans lequel figurent les informations relatives à la culture d\'entreprise, l\'organisation, les ressources humaines, la communication et la vie pratique de la Compagnie. »</div></li></ul>', '<p style=\"margin-bottom: 35px; padding: 0px; color: rgb(74, 74, 74); font-family: Nunito, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;\"><span style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">«&nbsp;Le développement des compétences est au cœur de la politique des ressources humaines de notre Compagnie. Il permet à nos équipes de mieux répondre aux évolutions technologiques, économiques ou réglementaires auxquelles le transport aérien est souvent confronté. C’est pourquoi, ASL Airlines France consacre chaque année une part importante de ses investissements à la formation, tant du personnel au sol que des équipages.</span><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"><b style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">20 051</b><span style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">&nbsp;heures de formation ont été dispensées en 2013 toutes catégories de métiers confondues et&nbsp;</span><b style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">920</b><span style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">&nbsp;actions de formation ont été organisées, soit une dépense en frais de formation de 7 % de la masse salariale.</span><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">Soulignons que notre Compagnie est agréée par la DGAC pour dispenser des formations à nos pilotes ainsi qu’à notre Personnel Navigant Commercial. Elle a signé un accord de partenariat avec Hub\'Air Aviation Academy qui forme des pilotes qualifiés Boeing 737. Pour plus d\'informations&nbsp;</span><a target=\"_blank\" href=\"http://www.hubair.com/\" href_cetemp=\"http://www.hubair.com\" style=\"font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">www.hubair.com</a><a href=\"http://www.aslairlines.fr/rejoignez_nous/mod_recruitment/recruitment/www.hubair.com\" href_cetemp=\"www.hubair.com\" style=\"font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"></a><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"><br style=\"color: rgb(0, 0, 0); font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\"></p><div style=\"font-family: &quot;Times New Roman&quot;; font-size: medium; text-align: justify;\">ASL Airlines France est également la première compagnie aérienne française à dispenser, au travers de l’<b><b>É</b>cole</b>, une formation qualifiante au métier de PNC dans le cadre d’un contrat de professionnalisation. »</div>', '<div align=\"justify\" style=\"font-family: &quot;Times New Roman&quot;; font-size: medium;\"><div align=\"justify\">« Parce que la diversité est une richesse, la pluralité des équipes un atout et l\'égalité des chances un devoir, ASL Airlines France mène depuis plusieurs années, une politique en faveur de la mixité professionnelle entre les femmes et les hommes, l\'emploi des seniors, la diversité sociale, ethnique et culturelle et l\'emploi des personnes en situation de handicap.<br><br>À travers notre démarche&nbsp;<b>Cap\'Handicap</b>, nous officialisons notre engagement et intensifions nos actions afin de favoriser l\'accès du monde du travail aux personnes handicapées. Cette démarche s\'articule autour de 5 domaines :</div><ul style=\"text-align: start;\"><li><div align=\"justify\"><u>Intégration et maintien dans l\'emploi</u>&nbsp;: réalisation des aménagements de poste pour pallier les contraintes du handicap, suivi régulier de l\'intégration de la personne handicapée ;</div></li><li><div align=\"justify\"><u>Sensibilisation et communication</u>&nbsp;: réalisation des actions de communication auprès de l\'ensemble de nos salariés, mise en oeuvre de sessions de sensibilisation auprès des managers et des instances représentatives du personnel ;</div></li><li><div align=\"justify\"><u>Sous-traitance</u>&nbsp;: développement de la sous-traitance de certaines activités avec des établissements du secteur du travail protégé et adapté ;</div></li><li><div align=\"justify\"><u>Partenariat avec les acteurs clés de l\'insertion professionnelle des travailleurs handicapés</u>&nbsp;tels que l\'Agefiph, Cap Emploi ou bien encore Sameth.&nbsp;»</div></li></ul></div>', '<div align=\"justify\" style=\"font-family: &quot;Times New Roman&quot;; font-size: medium;\">Nos processus de recrutement visent à appréhender au mieux les qualités professionnelles et personnelles des candidats afin de déceler l’adéquation entre une personne et un poste.<br><br>Nos processus comportent plusieurs étapes de sélection (dossier de candidature, tests, entretiens) qui peuvent différer en fonction de la catégorie d’offre à laquelle vous postulez. Nous veillons à ce que chaque étape de sélection se déroule en toute transparence et dans le respect de l’égalité des chances et de la confidentialité des informations transmises par les candidats.<br></div>', '8aebdb16f0e15b259cb0a1ec0db13dd4.jpg', '73e490b51b6c1c047e3f4f6f543e1090.jpg', '68016641956ca3684097df7efe682f58.jpg', 1, '2b6df6e987490c7fa4b8beb3a7ccb1a8.png');
