INSERT INTO `offers` VALUES (113, 'Chargé(e) d\'études marketing', 1, 3, '24', '2012-10-15', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">É<strong style=\"margin: 0px; padding: 0px;\">tudes marketing</strong></u>&nbsp;<strong style=\"margin: 0px; padding: 0px;\">:<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></strong></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.</li><li style=\"margin: 0px; padding: 0px;\">Études et veille tarifaire : analyse des tarifs de la concurrence, promotions, saisonnalité des divers marchés.</li><li style=\"margin: 0px; padding: 0px;\">Études comportementales de la demande : évolution des besoins, tendances, élasticité prix, segmentation typologique de clientèle, évolution des canaux de distribution.</li><li style=\"margin: 0px; padding: 0px;\">Benchmarking d\'Europe Airpost face à ses concurrents.</li><li style=\"margin: 0px; padding: 0px;\">Mise en forme et diffusion de l\'information à l\'équipe commerciale.</li><li style=\"margin: 0px; padding: 0px;\">Maintien et mise à jour des études déjà existantes.</li></ul><div style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Qualité</u>&nbsp;:<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></strong></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Saisie des questionnaires de satisfaction sur l\'outil en ligne.</li><li style=\"margin: 0px; padding: 0px;\">Analyse de la satisfaction client par le biais d\'études qualitatives et quantitatives.</li><li style=\"margin: 0px; padding: 0px;\">Diffusion des études liées à la satisfaction client au sein de la compagnie.</li><li style=\"margin: 0px; padding: 0px;\">Suivi des actions correctives à mettre en place.</li></ul><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Projets supports</u>&nbsp;:<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></strong></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Le titulaire pourra également se voir confier d\'autres missions dans le cadre de la définition du produit Europe Airpost.</li></ul></div>', '<li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">École de Commerce / Université</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Alternance sur 2 ans (idéalement&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 16.8667px; font-family: Calibri, sans-serif; font-size: 11pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 21.4667px; font-size: 14pt;\">¼</span></span>&nbsp;école,&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 16.8667px; font-family: Calibri, sans-serif; font-size: 11pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 21.4667px; font-size: 14pt;\">¾</span>&nbsp;</span>Europe Airpost)</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Bonne maîtrise de l\'anglais</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Maîtrise du pack Office</li>', NULL, 0, '2012-06-18', 39);
INSERT INTO `offers` VALUES (114, 'Administrateur du parc informatique', 1, 3, '24', '2012-08-19', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Au sein de l’équipe informatique d’Europe Airpost et directement rattaché(e) au Responsable Exploitation Informatique, vous apprendrez à assurer la maintenance du parc informatique, le niveau du service et de la sécurité des postes de travail. Les plateformes systèmes installées sont : Windows XP, Seven, 2003, 2008, 2010, Esx et Linux, messagerie EXCHANGE + Plate-forme BES, Vmware, Citrix, Kaspersky. Les serveurs sont implantés dans les locaux de Roissy.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Par nature, l’apprenti(e) sera en relation avec tous les services de la Compagnie et participera à l’administration, l’intégrité, la disponibilité, la sécurité, la rationalisation et l’optimisation des systèmes et réseaux.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Un réseau Ethernet permet aux différents postes d’accéder aux applications informatiques liées aux métiers aériens et aux applications bureautiques. Les plateformes installées sont Windows Serveur 2003, 2008, 2010, Windows Workstation XP/Seven, Linux, base de données (Oracle et SQL) et messagerie Exchange. La compagnie gère de façon autonome l’exploitation informatique des outils.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’apprenti(e) sera principalement amené à entretenir des relations permanentes avec tous les services de la Compagnie (et plus particulièrement le personnel navigant) et contribuera à leur apporter un soutien informatique tant logiciel que matériel.<br style=\"margin: 0px; padding: 0px;\">Il/Elle tiendra à jour les divers fichiers d’inventaire et prendra en charge les tâches administratives afférentes.</div>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Bac&nbsp;- Préparation de BTS&nbsp;Système Informatique aux Organisations ou équivalent.</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Polyvalence</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Curiosité</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Réactivité / Adaptabilité</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Savoir prioriser les urgences</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Patience et sens du service client</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Permis de conduire</div></li></ul>', NULL, 0, '2012-06-26', 39);
INSERT INTO `offers` VALUES (116, 'Ingénieur BEO Junior', 1, 2, '', '2012-08-05', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0px; padding: 0px;\">Sous la supervision du Responsable du Bureau Etudes Opérations, le titulaire est responsable de la rédaction, de l’élaboration et du suivi du manuel d’exploitation, ainsi que de la documentation réduite inhérente.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Le titulaire du poste est en charge de l’application au sein d’Europe Airpost des exigences de la Directive Européenne 2008/101/CE relative à l’intégration des activités aériennes dans le système communautaire d’échange de quotas d’émissions de gaz à effet de serre. Ces tâches comprennent notamment :</div><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">le contrôle et le suivi des données consommation en accord avec les exigences règlementaires,</li><li style=\"margin: 0px; padding: 0px;\">les relations avec les différentes directions impliquées de la compagnie, les compagnies partenaires, l’organisme de vérification et enfin les autorités (DGAC et Commission Européenne).</li></ul><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Le titulaire concourt à la gestion et au développement des programmes d\'analyse de performances au décollage et du calcul des règles d\'emport de carburant.</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Il reçoit et met à jour les documents constructeurs relatifs au type avion. Il effectue les modifications du volume B qui le concernent.</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Il est en charge&nbsp; de la vérification et de l’optimisation des limitations terrains, du suivi des pesées avion en liaison avec la Direction Technique ainsi que du suivi de l’évolution de toutes les données de masse et centrage et de leur bonne diffusion tant en interne qu’en externe.</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">De plus, des études spécifiques peuvent être menées dans des domaines particuliers soit pour des besoins propres à l\'entreprise, soit pour répondre à des exigences réglementaires (e.g. trouée d\'envol, Procédure en cas de survol montagneux, vol sur route ETOPS, RCF, enveloppe opérationnelle de centrage).</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Il concourt à la réalisation des dossiers dans lesquels la compétence du B.E.O est mise au service des autres Directions de l’entreprise, dans des domaines variés.</div></div>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Ingénieur ENAC ou assimilé</li><li style=\"margin: 0px; padding: 0px;\">Curieux</li><li style=\"margin: 0px; padding: 0px;\">Inventif</li><li style=\"margin: 0px; padding: 0px;\">Rigoureux</li><li style=\"margin: 0px; padding: 0px;\">Précis</li><li style=\"margin: 0px; padding: 0px;\">Avoir le goût du travail en équipe</li></ul>', NULL, 0, '2012-07-05', 39);
INSERT INTO `offers` VALUES (117, 'Assistant(e) facturation', 1, 1, '11', '2012-08-01', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Intégré(e) au service commercial, vous êtes responsable d\'une partie de la facturation clients au sein d’une équipe. A ce titre, vous serez en charge :</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">De la gestion des tableaux de suivi nécessaire à la réalisation des factures,</li><li style=\"margin: 0px; padding: 0px;\">Du traitement de la facturation dans les délais selon un échéancier,</li><li style=\"margin: 0px; padding: 0px;\">De la gestion des avoirs et litiges clients,</li><li style=\"margin: 0px; padding: 0px;\">De faire l\'interface entre les différents services (commercial, comptable).</li></ul><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Cette description reprend l\'essentiel des éléments du poste mais n\'est pas limitative.</div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Issu(e) d\'une formation de type Bac +2 en assistanat ou contrôle de gestion, vous justifiez d\'au moins une expérience à un poste similaire.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Vous maitrisez parfaitement le Pack Office, notamment Excel et ses fonctions avancées.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Votre rigueur, votre dynamisme et votre sens du travail en équipe feront la différence.</div>', NULL, 0, '2012-07-11', 39);
INSERT INTO `offers` VALUES (118, 'Gestionnaire outils pilotage commercial', 1, 1, '12', '2012-07-12', 1, '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Mise à jour des bases de données et outils informatiques de cotation des commerciaux.</li><li style=\"margin: 0px; padding: 0px;\">Mise à jour et création de documentation support pour les utilisateurs.</li><li style=\"margin: 0px; padding: 0px;\">Pilotage de la performance commerciale.</li><li style=\"margin: 0px; padding: 0px;\">Mise à jour et création de tableaux statistiques pour le compte de la direction commerciale.</li><li style=\"margin: 0px; padding: 0px;\">Projets support.</li></ul><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire pourra également se voir confier d\'autres missions ou études relatives au pilotage de l’activité de la Compagnie.</div>', '<div align=\"left\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\"><strong style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">CONNAISSANCES / EXPÉRIENCE</u>&nbsp;:</strong><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></span></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Niveau baccalauréat minimum</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Bonne maîtrise des outils bureautiques (Excel, Powerpoint)</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Bonne maîtrise de l’anglais</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Connaissance du milieu aérien</div></li><div align=\"left\" style=\"margin: 0px; padding: 0px;\">&nbsp;</div></ul><div align=\"left\" style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">QUALITÉS REQUISES</u>&nbsp;:</strong><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Réactivité</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Autonomie et disponibilité</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Rigueur et organisation</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Esprit d’analyse</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Gestion du stress</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"left\" style=\"margin: 0px; padding: 0px;\">Autonomie</div></li></ul></div>', NULL, 0, '2012-07-12', 39);
INSERT INTO `offers` VALUES (119, 'Assistant(e) Maitrise d\'ouvrage', 1, 1, '24', '2012-07-12', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0px; padding: 0px;\">Dans le cadre de directives et d\'instructions reçues du Responsable du service, l’apprenti aide le client final à définir et formuler ses besoins, et ce afin de choisir des services et des produits en adéquation avec les exigences métiers.</div><div style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><div style=\"margin: 0px; padding: 0px;\">Le poste est rattaché à la Direction des Systèmes d’Information. L’apprenti sera supervisé dans ses tâches par un Chef de Projet DSI.</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">ACTIVITES</strong></div><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;Connaissance fonctionnelle<br style=\"margin: 0px; padding: 0px;\"></em>L’apprenti doit connaître les différents métiers de la Direction Commerciale, l’organisation de cette Direction ainsi que les outils métier utilisés.<br style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;Assistance auprès des utilisateurs<br style=\"margin: 0px; padding: 0px;\"></em>L’apprenti accompagne son client dans la réalisation de son projet, dans la rédaction du cahier des charges et dans la mise en route du projet.<br style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;Documentation<br style=\"margin: 0px; padding: 0px;\"></em>Il est en charge de rédiger la documentation utilisateur des outils métier en respectant les procédures mises en œuvre à la Direction Commerciale.&nbsp;<br style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;Reporting<br style=\"margin: 0px; padding: 0px;\"></em>Il est l’interlocuteur privilégié entre la DSI et la DC et doit rapporter auprès de ces deux directions l’avancement des projets, les besoins exprimés par les utilisateurs, les contraintes techniques rencontrées sur ces projets.<br style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;Suivi projet<br style=\"margin: 0px; padding: 0px;\"></em>Il doit s\'inscrire dans une démarche projet, au sens où les délais et les objectifs doivent être respectés.</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">FINALITES<br style=\"margin: 0px; padding: 0px;\"></strong><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div>Assister l’utilisateur sur les projets informatiques et sur les outils métier<br style=\"margin: 0px; padding: 0px;\">Etre l’interlocuteur privilégié entre la DC et la DSI</div></div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">CONNAISSANCES / EXPERIENCE</strong></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Connaissance dans la gestion de projet&nbsp;</li><li style=\"margin: 0px; padding: 0px;\">Culture technologique</li><li style=\"margin: 0px; padding: 0px;\">Connaissance du Pack Office</li><li style=\"margin: 0px; padding: 0px;\">Bilingue anglais</li></ul><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">QUALITES REQUISES</strong></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Bon relationnel</li><li style=\"margin: 0px; padding: 0px;\">Capacité d’analyse</li><li style=\"margin: 0px; padding: 0px;\">Rigueur</li><li style=\"margin: 0px; padding: 0px;\">Organisation</li><li style=\"margin: 0px; padding: 0px;\">Capacité de synthèse</li></ul>', NULL, 0, '2012-07-12', 39);
INSERT INTO `offers` VALUES (120, 'Chargé(e) Ressources Humaines', 1, 1, '5', '2012-08-01', 1, '<p align=\"justify\" style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Intégré(e) à la Direction des Ressources Humaines, vous serez en charge :<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">De la gestion Administrative (courrier, attestation, dossier du personnel, Visite Médicale…) de la Direction des Ressources Humaines,De la gestion des contrats (CDD, CDI, Avenants, DUE…)<br style=\"margin: 0px; padding: 0px;\">De la formation (saisie, bilan de formation, préparation du Plan de Formation, CIF…)<br style=\"margin: 0px; padding: 0px;\">De l’intégration du salarié (inscription aux divers logiciels)</p><p align=\"justify\" style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Cette description reprend l\'essentiel des éléments du poste mais n\'est pas limitative.</p>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\"><div align=\"justify\" style=\"margin: 0px; padding: 0px;\">3 ans d’expérience en qualité de Chargée RH – Assistant RH sont nécessaires.</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"justify\" style=\"margin: 0px; padding: 0px;\">Vous maitrisez parfaitement le Pack Office.</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"justify\" style=\"margin: 0px; padding: 0px;\">Votre discrétion et confidentialité sont des qualités requises pour ce poste.</div></li><li style=\"margin: 0px; padding: 0px;\"><div align=\"justify\" style=\"margin: 0px; padding: 0px;\">Votre rigueur, votre dynamisme et votre sens du travail en équipe feront la différence.</div></li></ul>', NULL, 0, '2012-08-01', 39);
INSERT INTO `offers` VALUES (121, 'Apprenti(e) Comptable', 1, 3, '24', '2012-09-02', 1, '<div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans le cadre des procédures comptables définies par le Chef Comptable, et en collaboration avec les différents Directeurs, vous assurerez, en fonction du nombre de factures traitées, lié à la diversité des avions ainsi qu’au nombre d’escales et de vols opérés par la compagnie:<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Le contrôle des factures fournisseurs (tarifs et quantités).<br style=\"margin: 0px; padding: 0px;\">- La saisie et l’imputation analytique&nbsp; des factures dont vous vérifierez la validité (quantités, tarifs,…) avant transmission au Directeur correspondant pour un « bon à payer ».<br style=\"margin: 0px; padding: 0px;\">- La gestion et le suivi des factures en cas de litige.<br style=\"margin: 0px; padding: 0px;\">- La bonne transmission des documents au service compétent.<br style=\"margin: 0px; padding: 0px;\">- La tenue à jour des bases de données.<br style=\"margin: 0px; padding: 0px;\"></div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous serez également amené(e) à réaliser toute autre tâche que le chef comptable vous confiera en relation avec vos compétences actuelles et acquises.</div>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Préparation d’un BTS Comptabilité Contrôle de Gestion</li><li style=\"margin: 0px; padding: 0px;\">Connaissance et expérience en comptabilité générale souhaitée</li><li style=\"margin: 0px; padding: 0px;\">Familiarisation avec EXCEL/ORACLE (Base de données)</li><li style=\"margin: 0px; padding: 0px;\">Le permis B est un plus<br style=\"margin: 0px; padding: 0px;\"></li><li style=\"margin: 0px; padding: 0px;\">Organisation</li><li style=\"margin: 0px; padding: 0px;\">Rigueur</li><li style=\"margin: 0px; padding: 0px;\">Gestion du temps et des priorités</li><li style=\"margin: 0px; padding: 0px;\">Adaptabilité</li><li style=\"margin: 0px; padding: 0px;\">Bonne capacité d’identification dans une structure</li></ul>', NULL, 0, '2012-08-07', 39);
INSERT INTO `offers` VALUES (122, 'Stagiaire RH', 1, 5, '6', '2013-01-25', 1, '<p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Compagnie Aérienne Française, membre du groupe ASL aviation recherche :</p><div align=\"center\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><u style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Un(e) stagiaire RH</strong></u>&nbsp;:</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Au sein de la Direction des Ressources Humaines la mission s’articule autour d’un projet de Gestion Prévisionnelle des Emplois et des Compétences (GPEC), et de la refonte de nos accords d’entreprise.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Notre démarche GPEC a été initiée il y a trois ans, le ou&nbsp; la stagiaire sera chargé(e) du développement de cette démarche en maintenant à jour les&nbsp; définitions de poste, le référentiel des compétences, les passerelles possibles entre les différentes fonctions, ou les moyens d’optimiser l’organisation au sein de chaque service.</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Le stagiaire étendra ses missions à la participation à la gestion du plan de formation et du plan de recrutement.</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Il sera également amené à prendre en charge différentes études et projets liés à l’actualité Ressources Humaines.</div>', '<div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><u style=\"margin: 0px; padding: 0px;\">Profil recherché :</u></div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Niveau Licence ou Master 2<br style=\"margin: 0px; padding: 0px;\">Capacité d’analyse et d’adaptation<br style=\"margin: 0px; padding: 0px;\">Esprit d’initiative et d’équipe<br style=\"margin: 0px; padding: 0px;\">Maitrise des outils de bureautique (Excel, PowerPoint, Word, …)&nbsp;<br style=\"margin: 0px; padding: 0px;\">Début : ASAP<br style=\"margin: 0px; padding: 0px;\">Durée : 6 mois minimum<br style=\"margin: 0px; padding: 0px;\">Stage indemnisé</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div align=\"justify\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que le stage se déroule en zone de fret 7 à Roissy Charles de Gaulle.</div>', NULL, 0, '2013-01-25', 39);
INSERT INTO `offers` VALUES (123, 'Commercial', 1, 3, '12 à 24 mois', '2013-07-12', 1, '<div align=\"LEFT\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div align=\"LEFT\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\">Europe AIRPOST, Compagnie Aérienne Française, membre du groupe ASL aviation, leader dans le transport de fret et de passagers, nous recherchons un(e) :</font></div><br style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">Apprenti&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Direction Commerciale</div><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">Début ASAP, durée&nbsp;1 à 2 ans&nbsp;</div><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">&nbsp;</div><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Le contexte :</p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Rattaché au Responsable des ventes, le/la stagiaire sera chargé de la vente de vols passagers ponctuels – essentiellement sédentaire CDG.</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vous êtes rattaché à la Direction des opérations commerciales et du Programme et travaillez en étroite collaboration avec le Responsable des Ventes, les autres Attachés Commerciaux, le service Programme ainsi qu’avec l’ensemble des services opérationnels.</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vous êtes supervisé dans vos tâches par le Responsable des Ventes.</p><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vos missions :</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Commercial</u></p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participe aux démarchages et prospections clients français et étrangers&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe au marketing téléphonique auprès de clients potentiels&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux ventes auprès des Tours Opérateurs, agences, sociétés, clubs sportifs, brokers… de vols en série ou ponctuels&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux relations clientèles et suivis après-ventes&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux relances des clients sur les propositions émises&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe à l’établissement, la diffusion et le suivi des contrats</div><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Programme</u></p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participe à la diffusion des vols confirmés au service Programme&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participation à la préparation des vols.</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participation à la préparation et au suivi de la réalisation des vols.</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Fait l’interface avec le client et ses services opérationnels concernés</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\"></div></font><div style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Tâches annexes</u>&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Participation à l’établissement du Reporting Commercial (suivi de l’activité et de l’évolution du chiffre d’affaires par client, compte-rendu de visite clients, notes internes&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participation à l’organisation et à la réalisation des opérations commerciales et marketing (mailing, salons…)<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">&nbsp;- Participation et suivi de missions générales confiées à la Direction</font></div></div>', '<div style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Prérequis :</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Anglais : Bon niveau&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Pack Office : bonne maitrise d’Excel&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Excellent relationnel&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Goût pour le commercial&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Formation en cours école de commerce ou équivalent Bac +3 à Bac +5</font></font></div><div style=\"margin: 0px; padding: 0px; font-family: Calibri, Calibri; font-size: medium;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\">&nbsp;</font></div><p><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\"></font></font></p><div style=\"margin: 0px; padding: 0px;\"><p style=\"margin: 0px; padding: 0px;\">Nous sommes une compagnie aérienne située dans la zone de fret 7 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</p></div>', NULL, 0, '2013-07-12', 39);
INSERT INTO `offers` VALUES (124, 'Commercial', 1, 5, '6 à 24 mois', '2013-07-12', 1, '<div align=\"LEFT\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div align=\"LEFT\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\">Europe AIRPOST, Compagnie Aérienne Française, membre du groupe ASL aviation, leader dans le transport de fret et de passagers, nous recherchons un(e) :</font></div><br style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">Stagiaire<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Direction Commerciale</div><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">Début ASAP, durée 6 mois</div><br style=\"margin: 0px; padding: 0px;\"><div align=\"center\" style=\"margin: 0px; padding: 0px;\">&nbsp;</div><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Le contexte :</p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Rattaché au Responsable des ventes, le/la stagiaire sera chargé de la vente de vols passagers ponctuels – essentiellement sédentaire CDG.</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vous êtes rattaché à la Direction des opérations commerciales et du Programme et travaillez en étroite collaboration avec le Responsable des Ventes, les autres Attachés Commerciaux, le service Programme ainsi qu’avec l’ensemble des services opérationnels.</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vous êtes supervisé dans vos tâches par le Responsable des Ventes.</p><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Vos missions :</p><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Commercial</u></p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participe aux démarchages et prospections clients français et étrangers&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe au marketing téléphonique auprès de clients potentiels&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux ventes auprès des Tours Opérateurs, agences, sociétés, clubs sportifs, brokers… de vols en série ou ponctuels&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux relations clientèles et suivis après-ventes&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe aux relances des clients sur les propositions émises&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participe à l’établissement, la diffusion et le suivi des contrats</div><br style=\"margin: 0px; padding: 0px;\"></font><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Programme</u></p><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"></font></font><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participe à la diffusion des vols confirmés au service Programme&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participation à la préparation des vols.</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Participation à la préparation et au suivi de la réalisation des vols.</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">- Fait l’interface avec le client et ses services opérationnels concernés</div><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\"></div></font><div style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Tâches annexes</u>&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></font></font></strong><font size=\"3\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Participation à l’établissement du Reporting Commercial (suivi de l’activité et de l’évolution du chiffre d’affaires par client, compte-rendu de visite clients, notes internes&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Participation à l’organisation et à la réalisation des opérations commerciales et marketing (mailing, salons…)<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">&nbsp;- Participation et suivi de missions générales confiées à la Direction</font></div></div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Prérequis :</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">- Anglais : Bon niveau&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Pack Office : bonne maitrise d’Excel&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Excellent relationnel&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Goût pour le commercial&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Formation en cours école de commerce ou équivalent Bac +3 à Bac +5</font></font></div><div style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\">&nbsp;</font></div><div style=\"margin: 0px; padding: 0px;\"><p style=\"margin-bottom: 0px; padding: 0px;\">Nous sommes une compagnie aérienne située dans la zone de fret 7 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</p></div><p><font size=\"3\" face=\"Calibri,Calibri\" style=\"margin: 0px; padding: 0px;\"><font size=\"3\" style=\"margin: 0px; padding: 0px;\"></font></font><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p><div style=\"margin: 0px; padding: 0px;\"></div>', NULL, 0, '2013-07-12', 39);
INSERT INTO `offers` VALUES (125, 'Personnel Navigant Commercial', 2, 1, '6', '2014-02-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous ouvrons actuellement une campagne de recrutement en CDD ou contrat de professionnalisation de Personnel Navigant Commercial (hôtesse et steward)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre sens du service et des responsabilités et votre agréable relationnel vous permettront d’offrir à nos passagers un service de qualité et de représenter notre Compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Postulez en déposant votre candidature en ligne pour participer à nos sélections qui auront lieu dans les prochains jours.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d’un CFS ou d’un CCA, vous avez un bon niveau d’anglais.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2013-11-07', 39);
INSERT INTO `offers` VALUES (126, 'Stagiaire Juriste', 1, 1, '5', '2014-03-05', 1, '<p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\"><strong style=\"margin: 0px; padding: 0px;\">Le contexte&nbsp;:</strong></span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\">Vous êtes rattaché(e) à la Direction Générale et travaillez en étroite collaboration avec notre Juriste,&nbsp;</span>&nbsp;</p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Dans le cadre de vos missions, vous serez amené(e)&nbsp;à participer à:</strong></span></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: norma