; line-height: 18.4px; font-size: 12pt;\">- Anglais: très bon niveau d’anglais juridique</span></div><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">-&nbsp;<span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">Pack Office&nbsp;: bonne maitrise,</span></div><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">-&nbsp;</span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">Excellent relationnel,&nbsp;<br style=\"margin: 0px; padding: 0px;\">-&nbsp;</span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">Rigueur,</span></div><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">- Qualité rédactionnelle</span></div><div style=\"margin: 0px 0px 10pt; padding: 0px; line-height: 12.65px; text-indent: -18pt;\"><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">- Formation en cours Bac +5 idéalement en droit privé<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span></div><p style=\"margin-bottom: 0px; padding: 0px;\">&nbsp;</p><p style=\"margin-bottom: 0px; padding: 0px;\">&nbsp;</p><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\">Nous sommes une compagnie aérienne située dans la zone de fret 7 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span></div><p style=\"margin-bottom: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\">Nous vous remercions de nous transmettre vos candidatures par le biais de notre site&nbsp;:<br style=\"margin: 0px; padding: 0px;\">Europeairpost.com / rejoignez-nous.</span></p></div>', NULL, 0, '2014-03-05', 39);
INSERT INTO `offers` VALUES (127, 'Chargé(e) d\'études marketing', 1, 3, '24', '2014-09-01', 1, '<div dir=\"ltr\" style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div dir=\"ltr\" style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Études marketing</u>&nbsp;:<br style=\"margin: 0px; padding: 0px;\"></div><div dir=\"ltr\" style=\"margin: 0px; padding: 0px;\">&nbsp;</div><ul dir=\"ltr\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Etudes de lignes aériennes</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Études et veille tarifaire : analyse des tarifs de la concurrence, promotions, saisonnalité des divers marchés.</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Études comportementales de la demande : évolution des besoins, tendances, élasticité prix, segmentation typologique de clientèle, évolution des canaux de distribution</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Benchmarking d\'Europe Airpost face à ses concurrents</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Mise en forme et diffusion de l\'information à l\'équipe commerciale</div></li><li style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">Maintien et mise à jour des études déjà existantes.</div></li></ul><div dir=\"ltr\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Qualité</u>&nbsp;:</div><div dir=\"ltr\" style=\"margin: 0px; padding: 0px;\">&nbsp;</div><blockquote dir=\"ltr\" style=\"padding: 0px; font-size: 11px;\"><div dir=\"ltr\" style=\"margin: 0px; padding: 0px;\">• Saisie des questionnaires de satisfaction sur l\'outil en ligne.<br style=\"margin: 0px; padding: 0px;\">• Analyse de la satisfaction client par le biais d\'études qualitatives et quantitatives.<br style=\"margin: 0px; padding: 0px;\">• Diffusion des études liées à la satisfaction client au sein de la compagnie.<br style=\"margin: 0px; padding: 0px;\">• Suivi des actions correctives à mettre en place.</div></blockquote><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Projets Supports</u>&nbsp;:</div><div style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Le titulaire pourra également se voir confier d\'autres missions dans le cadre de la définition du produit Europe Airpost.</div><div><br></div></div>', '<li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">École de Commerce / Université</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Alternance sur 2 ans (idéalement ¼ école, ¾ Europe Airpost)</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Bonne maîtrise de l\'anglais</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Maîtrise du pack Office</li>', NULL, 0, '2014-06-02', 39);
INSERT INTO `offers` VALUES (128, 'Stage de Contrôle de Gestion', 1, 1, '6', '2014-10-01', 1, '<p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Europe AIRPOST, Compagnie<br style=\"margin: 0px; padding: 0px;\">Aérienne Française, membre du groupe ASL Aviation, leader dans le transport de fret et de passagers (200M€ de Chiffres d’Affaires), nous recherchons un(e)&nbsp;:</span></p><p align=\"center\" style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Stagiaire</span></strong></p><p align=\"center\" style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Direction Administrative et Financière</span></strong></p><p align=\"center\" style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Début ASAP, durée 6 mois</span></strong></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Le contexte&nbsp;:</span></strong></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Rattaché(e) au Responsable de Contrôle de Gestion, vous travaillerez sur le projet Lancement du Reporting Automatisé avec Hyperion Essbase.</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Vous serez affecté(e) à la<br style=\"margin: 0px; padding: 0px;\">Direction Administrative et Financière et travaillerez avec l’équipe Contrôle de Gestion composée de 5 personnes.</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Dans le cadre de ce projet d’automatisation,</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Vos missions&nbsp;seront les suivantes&nbsp;:</span></strong></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Participation à l’élaboration du budget général,</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Suivi du budget prévisionnel,</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Réalisation de tableaux de bord pour apprécier les évolutions,</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Répartition des recettes et charges</span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Projets ponctuels</span></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\"></span>&nbsp;</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Nous sommes une compagnie aérienne située dans la zone de fret 7 de Roissy Charles<br style=\"margin: 0px; padding: 0px;\">de Gaulle, un véhicule est donc préférable pour se rendre dans nos locaux.</span></p>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Prérequis :</span><div style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div></strong><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">Anglais :Bon niveau</span></div><p style=\"margin: 0cm 0cm 0pt 36pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 12.65px; text-indent: -18pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"></span></span><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">Pack Office : bonne maitrise d’Excel</span></p><p style=\"margin: 0cm 0cm 0pt 36pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 12.65px; text-indent: -18pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">Gout des chiffres et de l’analyse financière</span></p><p style=\"margin: 0cm 0cm 0pt 36pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 12.65px; text-indent: -18pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">Sens de l’organisation</span></p><p style=\"margin: 0cm 0cm 0pt 36pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 12.65px; text-indent: -18pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">La maîtrise des bases de données et des macros sous Excel seraient un plus.</span></p><p style=\"margin: 0cm 0cm 10pt 36pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 12.65px; text-indent: -18pt;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">Formation en cours école de commerce ou équivalent Bac +4 à Bac +5</span></p>', NULL, 0, '2014-09-05', 39);
INSERT INTO `offers` VALUES (129, 'Stagiaire Marketing', 1, 5, '6', '2015-03-01', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0px; padding: 0px;\">« Compagnie Aérienne Française, membre du groupe ASL aviation, leader dans le transport de fret et de passagers, recherche un(e) :</div><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><div align=\"center\" style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Stagiaire au Service Marketing de la Direction Commerciale<br style=\"margin: 0px; padding: 0px;\">Début&nbsp;mars&nbsp;/ avril 2015<br style=\"margin: 0px; padding: 0px;\">6 mois</u></strong></div><div style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Missions :</strong></div><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><p style=\"margin-bottom: 0px; padding: 0px;\">Rattaché(e) au Responsable Marketing, le/la stagiaire participera aux missions :</p><p style=\"margin-bottom: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;D’études de lignes (analyse des routes, tarifs, concurrents, chiffrage financier)</p><p style=\"margin-bottom: 0px; padding: 0px;\">-&nbsp;D’amélioration de notre offre (gestion de projets transverses)</p></div>', '<div class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><div class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Compétences nécessaires à la mission :</strong></div><div class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; padding: 0px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; text-align: start;\">-&nbsp;Bon niveau d’Anglais</div><div style=\"margin: 0px; padding: 0px; text-align: start;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Très bonne maîtrise d’Excel</div><div style=\"margin: 0px; padding: 0px; text-align: start;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Excellent relationnel</div><div style=\"margin: 0px; padding: 0px; text-align: start;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Goût pour le marketing</div><div style=\"margin: 0px; padding: 0px; text-align: start;\"><br style=\"margin: 0px; padding: 0px;\">-&nbsp;Bonne culture générale du tourisme et du secteur aérien<br style=\"margin: 0px; padding: 0px;\"></div><div style=\"margin: 0px; padding: 0px; text-align: start;\"><br style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Profil :</strong></div><div style=\"margin: 0px; padding: 0px; text-align: start;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; text-align: start;\">BAC +5 ou Mastère Spécialisé de type IFURTA, ENAC, ESCAET<br style=\"margin: 0px; padding: 0px;\">Sensibilité à l\'aérien</div><div style=\"margin: 0px; padding: 0px; text-align: start;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; text-align: start;\">Nous sommes situés dans la zone de fret 7 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</div></div>', NULL, 0, '2014-12-18', 39);
INSERT INTO `offers` VALUES (130, 'Agent de planning', 1, 1, '6 (minimum)', '2015-03-01', 1, '<p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) au Directeur Adjoint des Opérations Aériennes, vous procédez à la planification des immobilisations et des activités aériennes du Personnel Navigant Technique et Commercial de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><div class=\"MsoFooter\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Dans ce cadre,&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">vous élaborez les tours de service des Personnel Naviguant en fonction de la charge-programme et du niveau des immobilisations déterminé par les responsables de la production PN<br style=\"margin: 0px; padding: 0px;\">dans le respect des textes régissant le régime de travail du Personnel Naviguant de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous en assurez le suivi opérationnel et pouvez être amené à prendre toutes les mesures de modification de l’activité pré-établie.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font></p><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi</span></p>', '<p><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">De formation Bac+2, Technico commercial, Gestion, Ordonnancement ou Logistique, vous saurez faire preuve de&nbsp;</span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">qualités d’écoute et de dialogue dans vos relations avec le PN.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span><br></p><div><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><br></span></div>', NULL, 0, '2015-01-22', 39);
INSERT INTO `offers` VALUES (131, 'Personnel Navigant Commercial', 2, 1, '6', '2015-01-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous ouvrons actuellement une campagne de recrutement en CDD ou contrat de professionnalisation de Personnel Navigant Commercial (hôtesse et steward)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre sens du service et des responsabilités et votre agréable relationnel vous permettront d’offrir à nos passagers un service de qualité et de représenter notre Compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Postulez en déposant votre candidature en ligne pour participer à nos sélections qui auront lieu dans les prochains jours.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d’un CFS ou d’un CCA et d\'une visite d\'aptitude physique et mentale à jour, vous avez un bon niveau d’anglais.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2015-01-27', 39);
INSERT INTO `offers` VALUES (132, 'Personnel Navigant Technique', 3, 1, '6', '2015-01-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Notre Compagnie recherche actuellement en CDD du Personnel Navigant Technique (Commandant de bord et Officier Pilote de Ligne).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Postulez en déposant votre candidature en ligne pour participer à nos sélections qui auront lieu dans les prochains jours.</span><br></p>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes titulaire d’une licence et d\'une aptitude physique et mentale à jour.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous possédez:</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;&nbsp;&nbsp;- 3000 heures de vol en tant que Commandant de Bord,</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">ou</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;&nbsp;&nbsp;- 400 heures de vol&nbsp;en tant qu\'Officier Pilote de Ligne.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes qualifié B737 CL/NG et êtes expérimenté.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon niveau d’anglais.</div>', NULL, 0, '2015-02-05', 39);
INSERT INTO `offers` VALUES (133, 'Gestionnaire Billetterie', 1, 1, '12', '2015-02-27', 1, '<div align=\"left\" style=\"margin: 0cm 0cm 8pt; padding: 0px; font-family: Arial, sans-serif; font-size: 13.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><div align=\"left\" style=\"margin: 0cm 0cm 8pt; padding: 0px; font-size: 13.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><strong style=\"margin: 0px; padding: 0px;\">Rattaché(e) au Responsable Marketing, vous participerez aux missions suivantes :</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Tarification</u><div style=\"margin: 0px; padding: 0px;\">Définition du pricing sur les lignes régulières</div></div><div align=\"left\" style=\"margin: 0cm 0cm 8pt; padding: 0px; font-size: 13.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><u style=\"margin: 0px; padding: 0px;\">Gestion de l’outil de réservation</u><div style=\"margin: 0px; padding: 0px;\">Création et gestion des programmes de vols réguliers<br style=\"margin: 0px; padding: 0px;\">Gestion de la capacité au quotidien<br style=\"margin: 0px; padding: 0px;\">Yield management<br style=\"margin: 0px; padding: 0px;\">Gestion des demandes particulières<br style=\"margin: 0px; padding: 0px;\">Mise à jour des informations taux de change et taxes</div></div><div align=\"left\" style=\"margin: 0cm 0cm 8pt; padding: 0px; font-size: 13.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><u style=\"margin: 0px; padding: 0px;\">Relations externes</u><div style=\"margin: 0px; padding: 0px;\">&nbsp;Gestion des relations avec Amadeus, ATPCO et les GSA dans différents pays<br style=\"margin: 0px; padding: 0px;\">Contact avec les tour-opérateurs et agences de voyage<br style=\"margin: 0px; padding: 0px;\">Gestion des cotations groupes<br style=\"margin: 0px; padding: 0px;\">Assistance technique et commerciale ventes individuelles</div></div><div style=\"margin: 0cm 0cm 8pt; padding: 0px; font-size: 13.3333px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><u style=\"margin: 0px; padding: 0px;\">Reporting ventes</u><div style=\"margin: 0px; padding: 0px;\">Création et suivi de reporting de ventes (ventes directes et indirectes)</div></div></div>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Formation supérieure tourisme (niveau Bac + 2 minimum)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Minimum de 2 ans d’expérience dans le secteur du tourisme et de préférence en compagnie aérienne</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Sens commercial, relationnel et bonne capacité d’analyse</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Esprit d’équipe</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Autonome, organisé et dynamique&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La maîtrise des outils informatiques est exigée (Excel, Power Point)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance du GDS Amadeus (la connaissance d’ATPCO serait un plus)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Bon niveau en anglais</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p><div><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br></span></div>', NULL, 0, '2015-02-27', 39);
INSERT INTO `offers` VALUES (134, 'Agent d\'opérations', 1, 1, '4 (minimum)', '2015-03-24', 1, '<div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) au&nbsp;R<span style=\"margin: 0px; padding: 0px;\">esponsable des Opérations, vous&nbsp;serez en charge principalement des tâches suivantes&nbsp;:</span></span></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Préparation des vols (étude des NOTAMS et de la météo, dépôt du FPL, élaboration et édition de l\'OFP en respectant les réglementations AIROPS et le Manex)</li><li style=\"margin: 0px; padding: 0px;\">Briefing équipage</li><li style=\"margin: 0px; padding: 0px;\">Gestion des créneaux ATC</li><li style=\"margin: 0px; padding: 0px;\">Suivi du vol</li></ul><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><br style=\"margin: 0px; padding: 0px;\">L’activité, basée à Roissy,&nbsp;est organisée en horaires décalés selon&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">un emploi du temps pré-établi.</span></div>', '<p><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Diplomé(e) de l\'ENAC ou d\'une école équivalente, vous serez faire preuve de réactivité et d\'adaptabilité<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Vous avez le sens du relationnel et vous disposerez d\'un esprit d’équipe<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous maitrisez l\'anglais</span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px; color: rgb(31, 73, 125); font-family: Symbol;\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span></span><span style=\"margin: 0px; padding: 0px;\">Une connaissance de FPM et de CHM est souhaitée</span></span><br></p>', NULL, 0, '2015-03-24', 39);
INSERT INTO `offers` VALUES (135, 'Stagiaire Juriste RH', 1, 1, '5', '2015-04-07', 1, '<p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\"><strong style=\"margin: 0px; padding: 0px;\">Le contexte&nbsp;:</strong></span></p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\"></span></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><font color=\"#376092\" style=\"margin: 0px; padding: 0px;\"></font>&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><font color=\"#376092\" style=\"margin: 0px; padding: 0px;\">Vous êtes rattaché(e) à la Direction des Ressources Humaines.&nbsp;<br style=\"margin: 0px; padding: 0px;\">Les populations présentes au sein de la Compagnie sont: Personnel Navigant, Personnel en horaire Administratif et Personnel en horaire décalé.</font></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><br style=\"margin: 0px; padding: 0px;\"></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\">&nbsp;</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Dans le cadre de vos missions, vous serez amené(e)&nbsp;à effectuer les missions suivantes:</strong></span></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span></span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\">- Proposition d\'amélioration des modèles des contrats de travail</span></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\">&nbsp;</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\">- Etat des lieux des accords d\'entreprise</span></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\">&nbsp;</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"></p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\">-&nbsp;<font color=\"#376092\" style=\"margin: 0px; padding: 0px;\">La recherche et la veille juridique</font><br style=\"margin: 0px; padding: 0px;\"><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><br style=\"margin: 0px; padding: 0px;\"></span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\">- Projets ponctuels</span></div><div><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146);\"><br></span></div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">- Bac + 4 ou Bac + 5<br style=\"margin: 0px; padding: 0px;\"></span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">-&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-size: 12pt;\">P</span></span><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); line-height: 18.4px; font-size: 12pt;\">ack Office&nbsp;: bonne maitrise<br style=\"margin: 0px; padding: 0px;\">- Capacité d\'analyse et d\'adaptation<br style=\"margin: 0px; padding: 0px;\">- Esprit d\'analyse et d\'équipe&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Dicrétion&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Rigueur&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Excellent relationnel&nbsp;<br style=\"margin: 0px; padding: 0px;\">- Qualité rédactionnelles</span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\">Nous sommes une compagnie aérienne située dans la zone de fret 7 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(55, 96, 146); font-size: 12pt;\">Nous vous remercions de nous transmettre vos candidatures par le biais de notre site&nbsp;:<br style=\"margin: 0px; padding: 0px;\">Europeairpost.com / rejoignez-nous.</span></p>', NULL, 0, '2015-04-07', 39);
INSERT INTO `offers` VALUES (136, 'Apprenti(e) Communication', 1, 1, '12', '2015-09-01', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">1. MISSIONS PRINCIPALES</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Assister l’équipe Communication composée de 3 personnes :&nbsp;<br style=\"margin: 0px; padding: 0px;\">PAO print et web : newsletter, invitations, brochure…<br style=\"margin: 0px; padding: 0px;\">Création infographie et iconographie pour tout support web et papier…&nbsp;<br style=\"margin: 0px; padding: 0px;\">Création de diaporamas ou de vidéos pour la promotion des évènements de la compagnie.&nbsp;<br style=\"margin: 0px; padding: 0px;\">Reportages photos.<br style=\"margin: 0px; padding: 0px;\">Aide ponctuelle logistique sur nos évènementiels : salon Top Résa, soirée clients, soirée du personnel.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">2. PROJET</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Le projet « fil rouge » du candidat sera à déterminer en fonction de l’actualité de la Compagnie.<br style=\"margin: 0px; padding: 0px;\">Piste envisagée à ce stade : Refonte de la brochure de la Compagnie.</div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">3. PROFIL</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">L’apprenti(e) dispose de compétences techniques : connaissance des technologies web, parfaite maîtrise des outils de PAO : Indesign, Photoshop, Illustrator… et de la chaîne graphique afin d’être à même de réaliser tout support de communication « print » ou « web ».<br style=\"margin: 0px; padding: 0px;\">Orthographe irréprochable<br style=\"margin: 0px; padding: 0px;\">Environnement PC et Mac<br style=\"margin: 0px; padding: 0px;\">Le sens de l’autonomie, de la réflexion, de l’initiative, de l’organisation et de la confidentialité sont requis.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><strong style=\"margin: 0px; padding: 0px;\">4. CURSUS SOUHAITÉ</strong><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Titulaire impérativement d’un BAC + 2 Communication et Industries Graphiques et être admis(e) en Licence professionnelle Ingénierie et Management de projets en Communication et Industries Graphiques.</div><div><br></div>', NULL, 0, '2015-04-28', 39);
INSERT INTO `offers` VALUES (137, 'Apprenti(e) Marketing', 1, 3, '24', '2015-09-01', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: Calibri, sans-serif; font-size: 12pt;\">Rattaché(e) au service Marketing de la Direction Commerciale et du Programme vos missions s’articuleront autour des domaines suivants :<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Études marketing :</u></span></div><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px;\">•&nbsp;Etudes de lignes aériennes<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Études et veille tarifaire : analyse des tarifs de la concurrence, promotions, saisonnalité des divers marchés.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Études comportementales de la demande : évolution des besoins, tendances, élasticité prix, segmentation typologique de clientèle, évolution des canaux de distribution.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Benchmarking d\'Europe Airpost face à ses concurrents.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Mise en forme et diffusion de l\'information à l\'équipe commerciale.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Maintien et mise à jour des études déjà existantes.<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Qualité :</u></div><div style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\"></u><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Saisie des questionnaires de satisfaction sur l\'outil en ligne.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Analyse de la satisfaction client par le biais d\'études qualitatives et quantitatives.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Diffusion des études liées à la satisfaction client au sein de la compagnie.<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Suivi des actions correctives à mettre en place.<br style=\"margin: 0px; padding: 0px;\">Projets supports :<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Le titulaire pourra également se voir confier d\'autres missions dans le cadre de la définition du produit Europe Airpost.</div></div>', '<p style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.948px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•&nbsp;École de Commerce / Université</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•&nbsp;Alternance sur 2 ans (idéalement ¼ école, ¾ Europe Airpost)</span></p><p style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.948px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•&nbsp;Bonne maîtrise de l\'anglais</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•&nbsp;Maîtrise du pack Office</span><br></p>', NULL, 0, '2015-04-30', 39);
INSERT INTO `offers` VALUES (138, 'Apprenti(e) Logistique', 1, 3, '12 à 24', '2015-09-01', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Engineering de la Direction Technique, vos missions s’articuleront autour des domaines suivants :<br style=\"margin: 0px; padding: 0px;\"></div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Relance des commandes open<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Approvisionneur<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Gestion des stocks en surplus. Mise à la vente<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Optimisation des stocks<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Optimisation des achats, regroupement des achats par famille et par fournisseur</p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;BAC +2 / BAC +3 internationale (Supply chain, logistique, douane, achat)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Maitrise de l’anglais indispensable</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Connaissance du milieu aéronautique</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Rigoureux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Capacité d’analyse et de synthèse</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Sérieux</span><br></p>', NULL, 0, '2015-04-30', 39);
INSERT INTO `offers` VALUES (139, 'Stagiaire ou apprenti(e) Ressources Humaines', 1, 1, '6 à 12', '2015-06-12', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous serez amené à travailler en totale autonomie au sein de la Direction des Ressources Humaines autour de divers projets tels que :<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Proposition d’amélioration des modèles des contrats de travail<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Etude sur les Contrats à Durée Déterminée des Personnels Navigants<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Etat des lieux des accords d’entreprises<br style=\"margin: 0px; padding: 0px;\">•&nbsp;GPEC</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">Pour cela, vos bonnes connaissances en Ressources Humaines doivent vous permettre de/d’:</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Analyser l’existant&nbsp;<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Vérifier le respect de la législation en vigueur<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Etablir une veille juridique<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Proposer des solutions&nbsp;<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Etre force de proposition en apportant des améliorations aux processus RH<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Mettre en œuvre les solutions retenues</p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Profil recherché :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Bac +4 ou Bac +5</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Capacité d’analyse&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Esprit d’initiative&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Force de proposition</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Discrétion</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Autonome</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Qualité rédactionnelle</span><br></p>', NULL, 0, '2015-06-12', 39);
INSERT INTO `offers` VALUES (140, 'Comptable Fournisseurs', 1, 1, '5', '2015-06-18', 1, '<div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) à la Direction Administrative et Financière vos missions s’articuleront autour des domaines suivants :<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Préparation des règlements Fournisseurs</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Pointage et lettrage de Grand Livre Fournisseur</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Saisie de Facture Fournisseur dans un logiciel métier</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•&nbsp;Facturation client</div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Qualités requises</u>&nbsp;:&nbsp;<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Rigueur</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\">•&nbsp;Dynamisme</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\">•&nbsp;Sens du travail en équipe</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Profil recherché :</u><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Niveau BAC + 2<br style=\"margin: 0px; padding: 0px;\">•&nbsp;2 années d’expériences en comptabilité&nbsp;</div>', NULL, 0, '2015-06-18', 61);
INSERT INTO `offers` VALUES (141, 'Agent Technique', 1, 1, '6', '2015-08-02', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px;\">Missions :</span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div>Suivi des documents réglementaires<br style=\"margin: 0px; padding: 0px;\">Suivi des modifications Compagnie<br style=\"margin: 0px; padding: 0px;\">Standard technique&nbsp;<br style=\"margin: 0px; padding: 0px;\">Relations avec les Services Officiels<br style=\"margin: 0px; padding: 0px;\">Suivi opérationnel de la flotte<br style=\"margin: 0px; padding: 0px;\">Relations avec les constructeurs et équipementiers&nbsp;<br style=\"margin: 0px; padding: 0px;\">Restitution, Phase In d’avion&nbsp;<br style=\"margin: 0px; padding: 0px;\">Elaboration et suivi du budget travaux<br style=\"margin: 0px; padding: 0px;\">Interface PN</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives.</p>', '<p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">PROFIL</p><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">BTS avec expérience, IMA ou niveau équivalent d’expérience sanctionné par une évaluation<br style=\"margin: 0px; padding: 0px;\">Pratique de l’anglais technique et conversation de bon niveau<br style=\"margin: 0px; padding: 0px;\">Connaissance de l\'environnement Windows et pratique des environnements informatiques (TRAX, AMASYS)<br style=\"margin: 0px; padding: 0px;\">Expérience de bureau technique, production ou contrôle affirmée<br style=\"margin: 0px; padding: 0px;\">Connaissance de la réglementation dans ses différentes composantes (UE Ops, Part M, Part 145)</p><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\">QUALITES REQUISES :</div><p style=\"margin-bottom: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Autonomie<br style=\"margin: 0px; padding: 0px;\">Disponibilité<br style=\"margin: 0px; padding: 0px;\">Réactivité&nbsp;<br style=\"margin: 0px; padding: 0px;\">Sens du travail en équipe et de l\'organisation. Capacité à gérer des projets<br style=\"margin: 0px; padding: 0px;\">Aptitude aux outils informatiques<br style=\"margin: 0px; padding: 0px;\">Rigueur</p>', NULL, 0, '2015-08-02', 61);
