style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2015-08-18', 61);
INSERT INTO `offers` VALUES (143, 'Apprenti(e) Base de données & BI', 1, 3, '24', '2015-08-18', 1, '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px; font-family: Symbol; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px;\"><font face=\"Calibri\" style=\"margin: 0px; padding: 0px;\"><u style=\"margin: 0px; padding: 0px;\">Alternance en contrat d\'apprentissage ou en contrat de professionnalisation</u></font><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">·<span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;</span></span></span><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Créer des requêtes SQL pour les besoins d\'interfaces</span><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></font></span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Symbol; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px;\">·<span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;<span style=\"margin: 0px; padding: 0px; font-family: Calibri, sans-serif; font-size: 12pt;\">Se former à l’outil de requêtes SQL d’Oracle OBI (Oracle Business Intelligence) afin de pouvoir l’utiliser pour&nbsp;la maintenance et l’évolution de notre Datawarehouse. Pour cette mission,&nbsp;<span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">il travaillera directement avec le Chef de Projet BI.</span></span></span></span></span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\"></span><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Symbol; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px;\">·<span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;<span style=\"margin: 0px; padding: 0px; font-family: Calibri, sans-serif; font-size: 12pt;\">Se former notre ETL ODI (Oracle Database Integration) dans le but de créer de nouvelles interfaces sur les domaines existants.</span></span></span></span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\"></span>&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Symbol; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px;\">·<span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;<span style=\"margin: 0px; padding: 0px; font-family: Calibri, sans-serif; font-size: 12pt;\">Se former à l’administration des bases de données Oracle et MS SQL Server afin de pouvoir accomplir des tâches de contrôles, de tuning et d’optimisation de nos bases de donner. Pour cela, il sera encadré par le DBA d’ASL Airlines France.</span></span></span></span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Symbol; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"><span style=\"margin: 0px; padding: 0px; font-family: Calibri, sans-serif; font-size: 12pt;\"></span></span></span></span></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\"></span></div>', '<p><span style=\"color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 16px;\">Apprenti(e) spécialisé(e) dans les bases de données (Oracle et SQL Server) et dans le domaine de la Business Intelligence</span><o:p style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 16px;\"></o:p><br></p><div><span style=\"color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 16px;\"><br></span></div>', NULL, 0, '2015-08-18', 61);
INSERT INTO `offers` VALUES (144, 'Agent de planning', 1, 1, '3', '2015-10-08', 1, '<p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) au Directeur Adjoint des Opérations Aériennes, vous procédez à la planification des immobilisations et des activités aériennes du Personnel Navigant Technique et Commercial de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><div class=\"MsoFooter\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Dans ce cadre,&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">vous élaborez les tours de service des Personnel Naviguant en fonction de la charge-programme et du niveau des immobilisations déterminé par les responsables de la production PN<br style=\"margin: 0px; padding: 0px;\">dans le respect des textes régissant le régime de travail du Personnel Naviguant de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous en assurez le suivi opérationnel et pouvez être amené à prendre toutes les mesures de modification de l’activité pré-établie.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font></p><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span></p>', '<p><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">De formation Bac+2, Technico commercial, Gestion, Ordonnancement ou Logistique, vous saurez faire preuve de&nbsp;</span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">qualités d’écoute et de dialogue dans vos relations avec le PN.</span></p>', NULL, 0, '2015-10-08', 61);
INSERT INTO `offers` VALUES (145, 'Personnel Navigant Commercial', 2, 1, '6', '2016-04-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous ouvrons actuellement une campagne de recrutement en CDD ou contrat de professionnalisation de Personnel Navigant Commercial (hôtesse et steward)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre sens du service et des responsabilités et votre agréable relationnel vous permettront d’offrir à nos passagers un service de qualité et de représenter notre Compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Postulez en déposant votre candidature en ligne pour participer à nos sélections qui auront lieu dans les prochains jours.</span><br></p>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d’un CFS ou d’un CCA et d\'une visite d\'aptitude physique et mentale à jour.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon niveau d’anglais et êtes détenteur du TOEIC ou du BULATS.<br style=\"margin: 0px; padding: 0px;\"></div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre passeport et vos vaccins sont à jour.</div>', NULL, 0, '2015-11-20', 61);
INSERT INTO `offers` VALUES (146, 'Comptable Général', 1, 1, '10', '2015-12-02', 1, '<div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\">Rattaché(e) à la Direction Administrative et Financière, vos missions s’articuleront autour des domaines suivants :<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">L’intégration&nbsp;<br style=\"margin: 0px; padding: 0px;\">des écritures comptables dans le logiciel comptable et&nbsp;l</span><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">e contrôle des imputations</span><br style=\"margin: 0px; padding: 0px;\"></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">La&nbsp;<br style=\"margin: 0px; padding: 0px;\">saisie des OD</span><br style=\"margin: 0px; padding: 0px;\"></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">La&nbsp;<br style=\"margin: 0px; padding: 0px;\">préparation des arrêtés de comptes trimestriels</span></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"></span><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">La&nbsp;<br style=\"margin: 0px; padding: 0px;\">préparation des états de reportings mensuels</span></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"></span><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Le&nbsp;<br style=\"margin: 0px; padding: 0px;\">contrôle de l’analyse des comptes généraux</span></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"></span><br style=\"margin: 0px; padding: 0px;\">•&nbsp;La prise en charge de la&nbsp;<br style=\"margin: 0px; padding: 0px;\">gestion des immobilisations de la compagnie</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">• Assurer le contrôle des&nbsp;<br style=\"margin: 0px; padding: 0px;\">comptes de personnel en relation avec le service paie</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">• Divers états à la&nbsp;<br style=\"margin: 0px; padding: 0px;\">demande des services des douanes et de la banque de France,&nbsp;TVA</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\">• La gestion des fiches auxiliaires</div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">•&nbsp;<br style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; line-height: 18.4px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Remplacement du comptable&nbsp;<br style=\"margin: 0px; padding: 0px;\">trésorerie/clients durant les congés</span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d\'être modifiées en fonction de l\'évolution de l\'activité de la Compagnie et du Service Comptable.</div></div>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\"><div style=\"margin: 0px; padding: 0px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Qualités requises</u>&nbsp;:&nbsp;<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Rigueur</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Dynamisme</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Sens du travail en équipe</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Méthodologie</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Disponibilité</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Profil recherché :</u><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Maîtrise de la comptabilité générale, clients, fournisseurs, immobilisations, trésorerie, bilan</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Niveau BAC + 2<br style=\"margin: 0px; padding: 0px;\">•&nbsp;5 années d’expériences en comptabilité&nbsp;</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Maîtrise des outils informatiques notamment EXCEL, WORD et OUTLOOK</div></div>', NULL, 0, '2015-12-02', 61);
INSERT INTO `offers` VALUES (147, 'Personnel Navigant Technique', 3, 1, '6', '2016-04-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Notre Compagnie recherche actuellement en CDD du Personnel Navigant Technique (Commandant de bord et Officier Pilote de Ligne).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Postulez en déposant votre candidature en ligne pour participer à nos sélections qui auront lieu dans les prochains jours.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes titulaire d’une licence et d\'une aptitude physique et mentale à jour.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous possédez:</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;&nbsp;&nbsp;- 3000 heures de vol en tant que Commandant de Bord,</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">ou</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;&nbsp;&nbsp;- 400 heures de vol&nbsp;en tant qu\'Officier Pilote de Ligne.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes qualifié B737 CL/NG et êtes expérimenté.</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon niveau d’anglais.</div>', NULL, 0, '2016-02-02', 61);
INSERT INTO `offers` VALUES (148, 'Stagiaire Ressources Humaines', 1, 5, '6', '2016-02-12', 1, '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\">Les populations&nbsp;présentes au sein de la Compagnie sont&nbsp;: Personnel Navigant, Personnel en horaire Administratif et Personnel en horaire Décalé<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\">&nbsp;</p><div class=\"MsoNormal\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); font-family: Calibri, sans-serif; font-size: 12pt;\">Rattaché(e) à la Direction des Ressources Humaines les missions s’articuleront autour des domaines suivants&nbsp;:</span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><div class=\"MsoNormal\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); line-height: 16.8667px; font-family: Calibri, sans-serif; font-size: 11pt;\">- Proposition d\'amélioration des modèles des contrats de travail</span></div><div class=\"MsoNormal\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 32, 96); line-height: 16.8667px; font-family: Calibri, sans-serif; font-size: 11pt;\">- Etat des lieux des accords d\'entreprise</span></div><div class=\"MsoNormal\" style=\"ma