INSERT INTO `offers` VALUES (150, 'Stage à la Direction Commerciale', 1, 5, '6', '2016-02-19', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Ventes de la Direction Commerciale et du Programme, vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Démarches commerciales :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Développer la politique de prospection et d’acquisition de nouveaux marchés dans le transport aérien de passagers et de fret</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Effectuer des recherches de fonds sur les prospects pouvant être contactés</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Identifier les individus clés au sein des entreprises prospectes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Utiliser l’ensemble des outils mis à disposition (microsoft dynamics, icotour, recherches web)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Actions commerciales « opérationnelles » :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Réponses aux diverses demandes des clients</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Utilisation de l’outil de cotation ASL Airlines France</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etablissement d’offres commerciales</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Études commerciales et marketing :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etudes de lignes aériennes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etudes tarifaires</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous êtes en École de Commerce / Université</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous préparez un Master</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous êtes passionné(e) par l’aérien</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une bonne maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une bonne maîtrise de l\'anglais - Etre détenteur du TOEIC (score minimum 750)</span><br></p>', NULL, 0, '2016-02-19', 61);
INSERT INTO `offers` VALUES (151, 'Assistant(e) Communication', 1, 1, '2', '2016-03-16', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Communication de la Direction Générale vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Evènementiels internes et externes :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La responsabilité des évènementiels de la Compagnie tant internes (soirée annuelle du personnel, réunions cadres, etc.) qu’externes (soirée clients, Top Résa, Course La Parisienne…).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Mise en page :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La mise en page sous Indesign de documents tels que : newsletter, flash qualité de service hebdomadaires et mensuels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Mise en ligne d’informations :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La mise en ligne d’informations sur le site internet : communiqués de presse, photos, vidéos, pages destinations…</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La mise en ligne d’informations sur le site intranet : news, photos, vidéos, flash infos…</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Gestion Administrative :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le suivi du budget Communication sur Excel&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le suivi des commandes, ventes et des stocks d’objets promotionnels&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le support de l’équipe du Département Communication (commandes fournitures, stocks, …)</span><br></p>', '<div class=\"table_admin_body\" style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.938px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Titulaire d’un BAC +2 renforcé d’une expérience d’au moins 5 ans, vous maîtrisez le logiciel INDESIGN&nbsp;</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez des connaissances de base du logiciel PHOTOSHOP et en PAO</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Dynamique</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Réfléchi(e)</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Capacité d’adaptation</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Maîtrise des outils informatiques de bureautique (Word, Excel et Powerpoint)</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Qualités rédactionnelles</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Un bon niveau d’anglais serait un plus</span><br></div>', NULL, 0, '2016-03-16', 61);
INSERT INTO `offers` VALUES (152, 'Comptable Général', 1, 1, '6', '2016-05-09', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) à la Direction Administrative et Financière, vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’intégration des écritures comptables dans le logiciel comptable et le contrôle des imputations</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La saisie des OD</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La préparation des arrêtés de comptes trimestriels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La préparation des états de reportings mensuels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le contrôle de l’analyse des comptes généraux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La prise en charge de la gestion des immobilisations de la compagnie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Assurer le contrôle des comptes de personnel en relation avec le service paie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Divers états à la demande des services des douanes et de la banque de France, TVA</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La gestion des fiches auxiliaires</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Remplacement du comptable trésorerie/clients durant les congés</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d\'être modifiées en fonction de l\'évolution de l\'activité de la Compagnie et du Service Comptable.</span><br></p>', '<div style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; line-height: 22px;\"><div style=\"margin: 0px; padding: 0px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Qualités requises</u>&nbsp;:&nbsp;<br style=\"margin: 0px; padding: 0px;\">•&nbsp;Rigueur</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Dynamisme</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Sens du travail en équipe</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Méthodologie</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Disponibilité</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\"><u style=\"margin: 0px; padding: 0px;\">Profil recherché :</u><br style=\"margin: 0px; padding: 0px;\">•&nbsp;Maîtrise de la comptabilité générale, clients, fournisseurs, immobilisations, trésorerie, bilan</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">•&nbsp;Niveau BAC + 2<br style=\"margin: 0px; padding: 0px;\">•&nbsp;5 années d’expériences en comptabilité&nbsp;</div><div style=\"margin: 0px; padding: 0px; line-height: 22px;\">&nbsp;• Maîtrise des outils informatiques notamment EXCEL, WORD et OUTLOOK</div></div>', NULL, 0, '2016-05-09', 61);
INSERT INTO `offers` VALUES (153, 'Agent de planning', 1, 1, '5 (minimum)', '2016-05-09', 1, '<p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) à l\'Adjoint du Directeur des Opérations Aériennes, vous procédez à la planification des immobilisations et des activités aériennes du Personnel Navigant Technique et Commercial de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><div class=\"MsoFooter\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Dans ce cadre,&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">vous élaborez les tours de service du Personnel Naviguant en fonction de la charge-programme et du niveau des immobilisations déterminé par les responsables de la production PN<br style=\"margin: 0px; padding: 0px;\">dans le respect des textes régissant le régime de travail du Personnel Naviguant de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous en assurez le suivi opérationnel et pouvez être amené à prendre toutes les mesures de modification de l’activité pré-établie.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font></p><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span></p><div><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><br></span></div>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">De formation Bac+2, Technico commercial, Gestion, Ordonnancement ou Logistique, vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec le Personnel Navigant.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez le sens de la rigueur, de l\'organisation et du travail en équipe.</span><br></p>', NULL, 0, '2016-05-09', 61);
INSERT INTO `offers` VALUES (154, 'Agent d\'opérations', 1, 1, '5', '2016-05-13', 1, '<div style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><div style=\"margin: 0cm 0cm 7.5pt; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) au&nbsp;R<span style=\"margin: 0px; padding: 0px;\">esponsable des Opérations, vous&nbsp;serez en charge principalement des tâches suivantes&nbsp;:</span></span></div><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Préparation des vols (étude des NOTAMS et de la météo, dépôt du FPL, élaboration et édition de l\'OFP en respectant les réglementations AIROPS et le Manex)</li><li style=\"margin: 0px; padding: 0px;\">Briefing équipage</li><li style=\"margin: 0px; padding: 0px;\">Gestion des créneaux ATC</li><li style=\"margin: 0px; padding: 0px;\">Suivi du vol</li></ul><div style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><br style=\"margin: 0px; padding: 0px;\">L’activité, basée à Roissy,&nbsp;est organisée en horaires décalés selon&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">un emploi du temps pré-établi.</span></div><div><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><br></span></div></div>', '<p><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Diplomé(e) de l\'ENAC ou d\'une école équivalente, vous serez faire preuve de réactivité et d\'adaptabilité<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\">Vous avez le sens du relationnel et vous disposerez d\'un esprit d’équipe<br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous maitrisez l\'anglais</span><span style=\"margin: 0px; padding: 0px; text-align: justify; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\"><span style=\"margin: 0px; padding: 0px; color: rgb(31, 73, 125); font-family: Symbol;\"><span style=\"margin: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"><br style=\"margin: 0px; padding: 0px;\"><br style=\"margin: 0px; padding: 0px;\"></span></span><span style=\"margin: 0px; padding: 0px;\">Une connaissance de FPM et de CHM est souhaitée</span></span><br></p>', NULL, 0, '2016-05-13', 61);
INSERT INTO `offers` VALUES (155, 'Community Manager en alternance', 1, 3, '12', '2016-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Basé au siège social à Roissy, le Community Manager a pour mission de fédérer les internautes via les plateformes Internet autour de la marque ASL, d’animer et de faire respecter les règles éthiques de la communauté. Il apporte de l’information aux membres de la communauté et peut faire produire du contenu par les internautes de manière à développer la présence de la compagnie sur les réseaux sociaux et sur Internet en général.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">En tant que Community Manager, vous avez pour mission :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• D’animer les actions marketing en matière de médias sociaux afin qu’ils puissent correctement relayer et adapter les priorités de communication commerciale de l’entreprise</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De décliner sur les pages médias sociaux de la compagnie les principaux messages mis en avant par la Compagnie et d’y proposer une information pertinente</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De répondre aux questions « corporate » des fans et followers</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Mais aussi :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De réagir sur les médias sociaux en cas de crise</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De décliner chaque opération presse sur les médias sociaux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De concevoir des actions adaptées à ces nouveaux publics</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De promouvoir de manière proactive la compagnie auprès des influenceurs, des bloggeurs</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• De suivre les journalistes et influenceurs clés sur les différents réseaux sociaux ; d’analyser leurs réseaux relationnels ; de détecter les prises de parole susceptibles d’intéresser l’actualité et les intérêts de la compagnie&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• D’organiser des évènements destinés aux internautes&nbsp;</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Bac +5 type écoles spécialisées en communication, marketing, spécialisation communication on line.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Pour réussir dans cette mission, vous devez faire preuve d’une grande réactivité et d’esprit de synthèse, d’une bonne connaissance des médias sociaux et de leurs enjeux pour l’entreprise, vous devez connaitre la compagnie et ses circuits de décision pour une efficacité optimale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous aimez le travail en équipe, vous maitrisez couramment l’anglais à l’écrit comme à l’oral et vous disposez d’une grande aisance rédactionnelle et d’une orthographe irréprochable.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que le stage se déroule en zone Cargo 7 à Roissy Charles de Gaulle.</span><br></p>', NULL, 0, '2016-06-09', 61);
INSERT INTO `offers` VALUES (156, 'Apprenti(e) Marketing', 1, 3, '24', '2016-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Marketing de la Direction Commerciale et du Programme vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Études marketing :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etudes de lignes aériennes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Études et veille tarifaire : analyse des tarifs de la concurrence, promotions, saisonnalité des divers marchés.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Études comportementales de la demande : évolution des besoins, tendances, élasticité prix, segmentation typologique de clientèle, évolution des canaux de distribution.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Benchmarking d’ASL Airlines France face à ses concurrents.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Création et diffusion de reportings lignes régulières.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Maintien et mise à jour des études déjà existantes.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Qualité :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Saisie des questionnaires de satisfaction sur l\'outil en ligne.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Analyse de la satisfaction client par le biais d\'études qualitatives et quantitatives.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Diffusion des études liées à la satisfaction client au sein de la compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Suivi des actions correctives à mettre en place.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Projets supports :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le titulaire pourra également se voir confier d\'autres missions liée au marketing (produits à bord, évolution site internet, ...)</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•École de Commerce / Université</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Alternance sur 2 ans (idéalement ¼ école, ¾ entreprise)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Bonne maîtrise de l\'anglais</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que l’apprentissage se déroule en zone Cargo 7 à Roissy Charles de Gaulle.</span><br></p>', NULL, 0, '2016-06-09', 61);
INSERT INTO `offers` VALUES (157, 'Apprentis Paie et administration du personnel', 1, 3, '12', '2016-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’apprenti(e) sera amené(e) à effectuer les missions suivantes :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Saisie des données dans les logiciels de gestion des temps</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Intégration des éléments dans Système d’Informations Ressources Humaines (SIRH)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Edition des Bulletins de Paie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Gestion des déclarations d\'accident de travail&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Suivi du registre des accidents de travail&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Etablissement des attestations de salaires en cas de maladie, maternité, paternité, accident du travail</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Suivi les paiements d\'indemnités journalières de sécurité sociale&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Administration du personnel</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La connaissance de la paie n’est pas indispensable.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-BAC + 3 ou Bac +4</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Capacité d’analyse et d’adaptation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Esprit d’initiative et d’équipe&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Discrétion</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Maitrise des outils de bureautique (Excel, PowerPoint, Word, …)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que l’apprentissage se déroule en zone Cargo 7 à Roissy Charles de Gaulle.</span><br></p>', NULL, 0, '2016-06-16', 61);
INSERT INTO `offers` VALUES (158, 'Juriste Droit Social H/F', 1, 1, '4 à 6', '2016-07-12', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous recherchons un juriste en droit social spécialisé(e) en Droit Social et plus précisément, en relations collectives, pour une mission de 4 mois minimum.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d\'un 3eme cycle en Droit Social et/ou Droit des Relations Collectives, vous bénéficiez d\'une expérience en tant que juriste droit social.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La rigueur, l\'excellente rédaction, le relationnel, la ténacité et l\'expertise sont les qualités recherchées.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes disponible immédiatement.</span><br></p>', NULL, 0, '2016-07-12', 61);
INSERT INTO `offers` VALUES (159, 'Apprenti(e) commercial', 1, 3, '12', '2016-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Ventes de la Direction Commerciale et du Programme vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Prospection et suivi commercial :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Démarchages et prospection clients français et étrangers</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Relation clientèle et suivi après-ventes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Relance des clients sur les propositions émises…</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Rendez-vous clients existants et prospects</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Cotations vols ponctuels pax et Cargo :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Etablissement et suivi des devis</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Calcul des prix de vente, en collaboration avec le Responsable des Ventes et en relation avec le gestionnaire des outils de pilotage commerciaux et le contrôle de gestion.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Utilisation du logiciel de calcul APM</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous serez amené à avoir de nombreuses interactions avec les clients internes de la compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous pourrez être amené à faire des déplacements.</span><br></p>', '<div class=\"table_admin_body\" style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.938px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Votre profil :&nbsp;</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•École de Commerce / Université ou école spécialisée dans l’aérien</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•Bonne maîtrise de l\'anglais - Etre détenteur du TOEIC (score minimum 750)</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•Maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">•Etre passionné(e) par l’aérien</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Un véhicule est nécessaire compte tenu du fait que le stage se déroule en zone Cargo 7 à Roissy Charles de Gaulle.</span><br></div>', NULL, 0, '2016-07-26', 61);
INSERT INTO `offers` VALUES (160, 'Apprenti(e) communication', 1, 3, '12', '2016-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">1.	MISSIONS PRINCIPALES</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Assister l’équipe Communication&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">PAO print et web : newsletter, invitations, brochure…</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Création infographie et iconographie pour tout support web et papier…&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Création de diaporamas ou de vidéos pour la promotion des évènements de la compagnie.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Reportages photos.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Aide ponctuelle logistique sur nos évènementiels.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">2.	PROJET</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le projet « fil rouge » du candidat sera à déterminer en fonction de l’actualité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’apprenti(e) dispose de compétences techniques : connaissance des technologies web, parfaite maîtrise des outils de PAO : Indesign, Photoshop, Illustrator… et de la chaîne graphique afin d’être à même de réaliser tout support de communication « print » ou « web ».</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Orthographe irréprochable</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Environnement PC et Mac</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le sens de l’autonomie, de la réflexion, de l’initiative, de l’organisation et de la confidentialité sont requis.</span><br></p>', NULL, 0, '2016-08-11', 61);
INSERT INTO `offers` VALUES (161, 'Responsable Lignes BEO', 1, 2, '', '2016-08-17', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Sous la supervision du Responsable du Bureau Etudes/Opérations, le titulaire a pour missions:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Garantir la faisabilité opérationnelle des vols</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Prise en charge des cotations techniques et des routes nécessaires et étude opérationnelles des aéroports</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Elaborer des routes optimisées (temps de vol, consommation, redevances de routes, Météo statistique), en vérifier les conformités d’exploitation, constituer un catalogue et le mettre à disposition du Quart Opérations</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Participer au développement des procédures et des méthodes du Bureau d’Etudes Opérations</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer le suivi et la gestion du logiciel d’exploitation avec le fournisseur</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Concourir à l’ensemble des tâches du Bureau Etudes Opérations.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une expérience d\'agent d\'opérations avec de solides connaissances techniques, réglementaires et opérationnelles</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon niveau d’anglais courant et technique.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne maîtrise des techniques bureautiques.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Disponible, rigoureux, organisé, autonome et investi, vous avez le goût du travail en équipe.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes force de proposition.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne résistance au stress.</span><br></p>', NULL, 0, '2016-08-17', 61);
INSERT INTO `offers` VALUES (162, 'Agent Technique', 1, 2, '', '2016-10-03', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Suivi des documents réglementaires</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Suivi des modifications Compagnie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Standard technique&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Relations avec les Services Officiels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Suivi opérationnel de la flotte</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Relations avec les constructeurs et équipementiers&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Restitution, Phase In d’avion&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Elaboration et suivi du budget travaux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Interface PN</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">PROFIL</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">BTS avec expérience, IMA ou niveau équivalent d’expérience sanctionné par une évaluation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Pratique de l’anglais technique et conversation de bon niveau</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance de l\'environnement Windows et pratique des environnements informatiques (TRAX, AMASYS)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Expérience de bureau technique, production ou contrôle affirmée</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance de la réglementation dans ses différentes composantes (UE Ops, Part M, Part 145)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">QUALITES REQUISES :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Autonomie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Disponibilité</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Réactivité&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Sens du travail en équipe et de l\'organisation. Capacité à gérer des projets</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Aptitude aux outils informatiques</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rigueur</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2016-10-03', 61);
INSERT INTO `offers` VALUES (163, 'Responsable Commercial Cargo', 1, 2, '', '2016-12-15', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">RAISON D\'ETRE</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans le cadre des objectifs fixés par la Direction Générale de l’entreprise, des réglementations applicables et des procédures de la Direction des programmes et des opérations commerciales, le titulaire a pour mission d’accompagner le développement de l’activité « cargo » de l’entreprise et du chiffre d’affaires associé, en produisant les études tarifaires nécessaires aux propositions commerciales.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire assure la mise à jour des plans de chargement cargo dans les systèmes informatiques, met en forme et diffuse toutes informations liées au suivi du fret transporté et des recettes liées à l’activité cargo (« charter », « low fare régulière », « ACMI » ou « location coque nue »), recense et valorise tous les éléments concourants à garantir l’exhaustivité et la fiabilité de la facturation sous pavillon ASL Airlines France ou sous pavillon tiers.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il assure aussi le suivi et la mise à jour des budgets de recettes, il en analyse et justifie les écarts.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">DIMENSION</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Les éléments dimensionnant sont les suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- flotte cargo</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- portefeuille clients et le volume d’activité « cargo »</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- nombre de lignes commercialisées</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- chiffre d’affaires</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">CONTEXTE</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire du poste est rattaché au pôle commercial au sein de la Direction Commerciale et des Programmes. Il travaille en étroite collaboration avec le Responsable des Ventes, le Directeur Commercial et Programme, le service Programme, la Direction Financière (notamment pour la valorisation des contrats avec les grands comptes réguliers), le Responsable du pôle Administration des ventes, ainsi qu’avec l’ensemble des services opérationnels. Le titulaire est supervisé dans ses tâches par le Responsable des Ventes.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans ce contexte, le titulaire assure le suivi de l’ensemble des opérations commerciales et autres prestations placées sous la responsabilité de la Direction des Ventes. Il est l’interlocuteur privilégié des clients cargo pour tous les aspects relatifs aux modifications ponctuelles ou régulières des allotements réservés et est le garant de l’application des conventions et contrats « cargo ».&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">ACTIVITES</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">1. Commercial et gestion commerciale</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Démarchages et prospection clients français et étrangers&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Marketing : études de marché, études de faisabilité de lignes cargo, QC ou opérateur tiers</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Ventes auprès des offices postaux, expressistes, consolidateurs, transitaires, courtiers, etc., de vols en série ou ponctuels&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Identification et gestion de projets de nouvelles lignes cargo dédiées ou consolidées&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Relance des clients sur les propositions émises&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation à l’établissement, la diffusion et le suivi des contrats</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Le titulaire assure le suivi de l’ensemble des ventes,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il est en charge du suivi des allotements supplémentaires et des incidences des évènements d’exploitation sur la facturation et le chiffre d’affaires,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il assure le suivi des capacités utilisées et des disponibilités,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il est en charge du suivi des co-chargements.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">2. Suivi des contrats clients</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il suit et garantit le respect des modalités financières établies dans les contrats réservés et les disponibilités offertes,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il détermine et propose le Plan de Chargement en traduisant les volumes en unités d’œuvre (type de conteneurs),&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Il informe les services concernés de toute modification demandée par le client et validée par ASL Airlines France.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">3. Etudes&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Elabore toute étude ou simulation relative aux recettes et aux capacités transportées&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">4. Technique</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Etablissement rapide (24/48 h max) et suivi des devis (cotations)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Calcul des prix de vente, en collaboration avec l’Administration des Ventes et le Directeur Commercial et du Programme.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Etablissement de Business Case prévisionnels pour les nouvelles lignes étudiées.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Interface avec les services intervenant dans les données nécessaires à la réalisation des cotations.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Utilisation du logiciel de calcul APM et du logiciel CRM de la compagnie&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">5. Programme</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Diffusion des vols confirmés au service Programme pour intégration des vols dans NETLINE.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation à la préparation des vols&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation au suivi de la réalisation des vols&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Interface avec le client et ses services opérationnels concernés&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Animation et participation aux réunions internes et/ou avec les clients pour la préparation des vols&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Mise en place de procédures de vols avec les services internes de la compagnie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">6. Tâches annexes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation à l’établissement du Reporting Commercial (suivi de l’activité et de l’évolution du chiffre d’affaires par client, fiches de synthèse, comptes rendus de visite clients, notes internes sur l’actualité et les évolutions des clients et du secteur d’activité)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation à l’organisation et à la réalisation des opérations commerciales et marketing (mailing, salons…)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation et suivi de missions générales confiées à la Direction des programmes et des opérations commerciales par la Direction Générale&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Suivi des demandes spécifiques client et interface avec les services impliqués&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Participation à des projets, tâches, ou études transverses au sein de la Direction des programmes et des opérations commerciales, sur demande de sa hiérarchie.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Le cas échéant, participation à des projets passagers et des offres commerciales passagers.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-	Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">CONNAISSANCES / EXPERIENCE</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Expérience professionnelle reconnue dans un poste commercial comparable en compagnie aérienne, prestataire du secteur fret aérien, ou courtier aérien,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance du marché et de l’activité du transport aérien,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissances techniques opérationnelles,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Maîtrise de l’exploitation des vols,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Notion de gestion de projets,&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Pratique courante de l’anglais.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance du marché cargo aérien</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance opérationnelle du cargo</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Expertise technique liée au transport de marchandises spécifiques (DGR, AVI, HUM etc.).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">QUALITES REQUISES</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Autonomie et disponibilité,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rigueur et organisation,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Esprit logique et aisance avec le maniement des données financières,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Esprit d’équipe,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Facilités relationnelles et capacités de communication,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Esprit d’analyse, de synthèse,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Faculté à travailler sous pression et à définir les priorités.</span><br></p>', NULL, 0, '2016-12-15', 61);
INSERT INTO `offers` VALUES (164, 'Superviseur Escale', 1, 2, '', '2017-01-09', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Responsable d\'Escale de CDG, vous procédez à la supervision de l\'exploitation et au suivi de l\'ensemble des vols du réseau Cargo et Passager.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans ce cadre, vous veillez au respect des consignes et procédures transmises à nos assistances en vue de la réalisation de leurs prestations, et au respect des différentes contraintes (horaires, sécurité, sûreté...) affectant les touchées.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous assurez la supervision de tous les intervenants de la touchée et vous assurez le suivi de toutes les opérations en escale sur l\'ensemble du réseau.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span><br></p>', '<div class=\"table_admin_body\" style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.938px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">De formation Bac+2, vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec les intervenants.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous saurez faire preuve de réactivité, de maîtrise de soi, d\'adaptabilité et avez le sens de l\'organisation.&nbsp;</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez le sens du relationnel et vous disposez d\'un bon esprit d’équipe.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous maitrisez l\'anglais.</span><br></div>', NULL, 0, '2017-01-09', 61);
INSERT INTO `offers` VALUES (165, 'Stagiaire au Bureau d\'Etudes Opérations', 1, 5, '6', '2017-01-23', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">ASL Airlines France, Compagnie Aérienne Française, membre du groupe ASL aviation, leader dans le transport de fret et de passagers, recherche un Stagiaire à la Direction des Opérations Aériennes.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Responsable des Formations et Entrainements des Equipages, le/la stagiaire participera aux missions suivantes:&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Développer et perfectionner le logiciel Compliance,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Etudier et optimiser la planification des équipages.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Concourir à la réalisation des dossiers pour la Direction des Opérations Aériennes.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous sommes une compagnie aérienne située dans la zone de Cargo 9 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Ingénieur ENAC ou assimilé</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Curieux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Inventif</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Rigoureux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Précis</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Avoir le goût du travail en équipe</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2017-01-23', 61);
INSERT INTO `offers` VALUES (166, 'Agent de planning', 1, 1, '6 (minimum)', '2017-05-02', 1, '<p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Rattaché(e) à l\'Adjoint du Directeur des Opérations Aériennes, vous procédez à la planification des immobilisations et des activités aériennes du Personnel Navigant Technique et Commercial de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><div class=\"MsoFooter\" style=\"margin: 0cm 0cm 0pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Dans ce cadre,&nbsp;</span><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">vous élaborez les tours de service du Personnel Navigant en fonction de la charge-programme et du niveau des immobilisations déterminé par les responsables de la production PN<br style=\"margin: 0px; padding: 0px;\">dans le respect des textes régissant le régime de travail du Personnel Navigant de l’entreprise.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span><div style=\"margin: 0px; padding: 0px;\">&nbsp;</div></div><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">Vous en assurez le suivi opérationnel et pouvez être amené à prendre toutes les mesures de modification de l’activité pré-établie.<o:p style=\"margin: 0px; padding: 0px;\"></o:p></span></p><p style=\"margin: 0cm 0cm 7.5pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font><font face=\"Times New Roman\" style=\"margin: 0px; padding: 0px;\"></font></p><p class=\"Style1\" style=\"margin: 0cm 0cm 12pt; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Arial Narrow&quot;, sans-serif; font-size: 12pt;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">De formation Bac+2, Technico commercial, Gestion, Ordonnancement ou Logistique, vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec le Personnel Navigant.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez le sens de la rigueur, de l\'organisation et du travail en équipe.</span><br></p>', NULL, 0, '2017-05-02', 61);
INSERT INTO `offers` VALUES (167, 'Chargé(e) de Suivi Formation PN', 1, 2, '', '2017-05-04', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans le cadre des directives et des instructions reçues du Directeur des Opérations Aériennes et du Responsable Désigné Formation et Entraînement des Equipages / Responsable entrainement des équipages et de l’ATO, le titulaire contribue à la réalisation des dossiers techniques, financiers et opérationnels et à la mise en place des procédures de contrôle réglementaires garantissant la conformité des formations dispensées.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Responsable des Formations et Entrainements des Equipages, le titulaire a en charge les missions suivantes:&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Etablir le plan de formation PN,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Organiser la formation PNT : il prend les contacts nécessaires avec les fournisseurs, réserve et met en place les moyens nécessaires à la formation du PN au meilleur coût.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Gérer le budget de la formation PN.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Concourir à l\'élaboration et à la rédaction des support de formation et à la rédaction du contenu du Manuel D \"Formation\".</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Effectuer le suivi des formations: recueil, classement et archivage réglementaire de tous les actes de formation et d’appréciation professionnelle du PNT.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">-Superviser la saisie dans le système de planification.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance de la législation du travail des PN quant aux formations.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes à l\'aise dans l’expression écrite et la communication orale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous maîtrisez les logiciels de bureautique pour saisir des données, concevoir et mettre à jour des tableaux de bords.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un esprit de synthèse et le sens des priorités.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes méthodique, rigoureux(se) et organisé(e).&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous sommes une compagnie aérienne située dans la zone de Cargo 9 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2017-05-04', 61);
INSERT INTO `offers` VALUES (168, 'Apprenti(e) Comptable', 1, 3, '24', '2017-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans le cadre des procédures comptables définies par le Responsable Comptable, vous serez amené(e) à assurer les missions suivantes:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Comptabilité générale</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Suivi bancaire</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Gestion des immobilisations</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Reporting mensuels et trimestriels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Aide sur le projet de mise en place du logiciel SAP</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous serez également amené(e) à réaliser toute autre tâche que le responsable comptable vous confiera en relation avec vos compétences actuelles et acquises.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Préparation d’un DCG-DSCG</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Connaissance et expérience en comptabilité générale souhaitée</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Familiarisation avec EXCEL</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Organisation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Rigueur</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Gestion du temps et des priorités</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Adaptabilité</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Bonne capacité d’identification dans une structure</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que le stage se déroule en zone Cargo 9 à Roissy Charles de Gaulle.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2017-05-10', 61);
INSERT INTO `offers` VALUES (169, 'Apprenti(e) Logistique', 1, 3, '12', '2017-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Achat de la Direction Technique, vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Relance des commandes en retard</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Aide à la mise en place du logiciel AMOS</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Création d\'un fichier suivi des garanties</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Contractualisation des relations fournisseurs</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Optimisation des stocks</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Suivi des contrats</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• BAC +2 / BAC +3 internationale (Supply chain, logistique, douane, achat)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Maitrise de l’anglais indispensable</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Connaissance du milieu aéronautique</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Rigoureux</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Capacité d’analyse et de synthèse</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Sérieux</span><br></p>', NULL, 0, '2017-05-16', 61);
INSERT INTO `offers` VALUES (170, 'Apprenti Paie', 1, 3, '12', '2017-09-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’apprenti(e) sera amené(e) à effectuer les missions suivantes :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Saisie des données dans les logiciels de gestion des temps</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Intégration des éléments dans Système d’Informations Ressources Humaines (SIRH)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Edition des Bulletins de Paie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Gestion des déclarations d\'accident de travail&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Suivi du registre des accidents de travail&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Etablissement des attestations de salaires en cas de maladie, maternité, paternité, accident du travail</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">•Suivi des paiements d\'indemnités journalières de sécurité sociale&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">La connaissance de la paie n’est pas indispensable.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- BAC + 3 ou Bac +4</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Capacité d’analyse et d’adaptation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Esprit d’initiative et d’équipe&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Discrétion</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Maitrise des outils de bureautique (Excel, PowerPoint, Word, …)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Un véhicule est nécessaire compte tenu du fait que l’apprentissage se déroule en zone Cargo 9 à Roissy Charles de Gaulle.</span><br></p>', NULL, 0, '2017-05-18', 61);
INSERT INTO `offers` VALUES (171, 'Responsable Marketing', 1, 2, '', '2017-05-19', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire a pour mission :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Accompagner le développement de l’activité « passagers » et « fret » de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer l’étude du marché de transport aérien et aider à la décision quant à l’évolution de l’offre en produisant des études de marché et tarifaires, et en réalisant la veille concurrentielle.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Garantir la satisfaction et la fidélité des clients en mettant en place les produits adéquats dont il assure la promotion.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Garantir le respect des procédures Qualité au sein de la Direction Commerciale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer la bonne gestion de l’outil de cotation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Créer et mettre en place des plans d\'actions commerciales .</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire a pour mission d’accompagner la mise en place et le développement de l’activité de vente directe de billets aux passagers.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes une personne autonome, disponible, rigoureuse, organisée, réactive et créative.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous pratiquez l’anglais couramment.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez de bonnes connaissances du marché et de l’environnement de l’activité de transport aérien.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous disposez de connaissances techniques opérationnelles et de marketing.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes doté(e) d\'un esprit logique, d\'analyse et d’équipe et de bonnes capacités de communication.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes à l\'aise avec le maniement des données financières.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une expérience professionnelle dans un poste similaire.</span><br></p>', NULL, 0, '2017-05-19', 61);
INSERT INTO `offers` VALUES (172, 'Assistant Piste', 1, 1, '5', '2017-06-07', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le service Piste de la Compagnie a pour mission essentielle l’assistance au sol des avions et le contrôle du respect des procédures lors des opérations de chargement et déchargement assurées par les chargeurs des sous-traitants.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L\'Assistant Piste garantit la mise en place du matériel de piste et seconde le Chef de Piste dans sa mission d\'assistance des avions assurant le programme cargo de nuit par le chargement-déchargement du fret dans les meilleures conditions de sécurité, de régularité et de ponctualité et en veillant à la fiabilité du matériel de piste.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L\'assistant Piste a pour missions:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Chargement et déchargement du fret et traitement avions équipages en cargo en veillant au respect des règles de sécurité autour de l\'avion et des plans de chargement établis.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assistance départ / arrivée / repoussage:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Départ : le titulaire assure le départ de l\'avion au casque et est responsable de la sécurité de la mise en route de l\'avion.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Arrivée : le titulaire est en charge de guider l\'avion (signaux conventionnels) jusqu\'à son point de parking et de mettre en place le matériel (cales, groupes, passerelles).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Repoussage: le titulaire est en charge de la conduite du tracteur pour le repoussage des avions de leur point de stationnement.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Changement de version : Les avions utilisés par la Compagnie étant \"Quick-Change\", le titulaire aide à changer leurs versions entre les vols passagers de jour (la cabine est alors équipée de sièges) et les vols cargo de nuit (la cabine est vide).</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Tractage avion sur l\'aéroport : Le titulaire assiste le Chef de Piste lors du tractage de l\'avion sur l\'aéroport : il met en place la barre de remorquage et conduit le tracteur en liaison radio avec le Chef de Piste (présent dans le cockpit de l\'avion) qui lui indique le cheminement à suivre.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Niveau CAP</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Connaissance de la conduite des engins</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Connaissances concernant les normes de sécurité et de sureté, la règlementation de la circulation sur piste et la réglementation des marchandises dangereuses</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Titulaire du Permis B</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Faire preuve de fiabilité, réactivité, discipline</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Avoir un bon esprit d’équipe</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2017-06-07', 61);
INSERT INTO `offers` VALUES (173, 'Agent Technique Spécialité Avionique', 1, 2, '', '2017-07-12', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché à la Direction Technique, vous aurez pour missions:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p><div><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br></span></div>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">CONNAISSANCES / EXPERIENCE</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">BTS avec expérience, IMA ou niveau équivalent d’expérience sanctionné par une évaluation Pratique de l’anglais technique et conversation de bon niveau</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance de l\'environnement Windows et pratique des environnements informatiques (TRAX, AMASYS, AMOS)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Expérience de bureau technique, production ou contrôle affirmée</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissance de la réglementation dans ses différentes composantes (IROps, PART M, PART 145, PART 21)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">QUALITES REQUISES :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Autonomie Disponibilité Réactivité</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Sens du travail en équipe et de l\'organisation. Capacité à gérer des projets Aptitude aux outils informatiques</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rigueur</span><br></p>', NULL, 0, '2017-07-12', 61);
INSERT INTO `offers` VALUES (174, 'Aide Mécaniciens', 1, 1, '4', '2017-07-21', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L\'Aide mécanicien a pour mission d\'assurer les tâches annexes à l’entretien avion et assister les techniciens avion sur Roissy-CDG:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer les opérations de nettoyage avion dans le cadre de la maintenance</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer le nettoyage programmé des postes de pilotage</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer l’aide aux techniciens avion dans le cadre de la maintenance</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer les transports logistiques (pièces avions, moyens au sol, …)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer le suivi d’état des véhicules et des matériels de servitude</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes titulaire du permis B</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous faites preuve d\'autonomie et de rigueur.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez le sens du travail en équipe et une bonne capacité d\'adaptation.</span><br></p>', NULL, 0, '2017-07-21', 61);
INSERT INTO `offers` VALUES (175, 'Assistant(e) Ressources Humaines', 1, 1, '6', '2017-08-10', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) à la Direction des Ressources Humaines, vous serez en charge :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De la gestion Administrative (courrier, attestation, dossier du personnel, Visite médicale, entretien annuel)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De la gestion des contrats (CDD, CDI, Avenants, DPAE)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De l\'intégration du salarié (inscription aux divers logiciels, remise des documents)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De la formation (saisie, inscription, relation avec l\'OPCA)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De l\'établissement des bilans et reporting sur les différentes activités des Ressources Humaines&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Cette description reprend l\'essentiel des éléments du poste mais n\'est pas limitative.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous justifiez d\'au moins 3 ans d\'expérience en qualité d\'Assistant(e) RH</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous maitrisez parfaitement le Pack Office.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre discrétion et confidentialité sont des qualités requises pour ce poste.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre rigueur, votre dynamisme et votre sens du travail en équipe feront la différence.</span><br></p>', NULL, 0, '2017-08-10', 61);
INSERT INTO `offers` VALUES (176, 'Agent Technique Spécialité Structure', 1, 2, '', '2017-08-21', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché à la Direction Technique, le titulaire a pour mission de maintenir la flotte en parfaite conformité avec les évolutions techniques constructeurs et équipementiers.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’agent Technique Structure Cabine Fiabilité a en charge :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La gestion des documents réglementaires en assurant le suivi de la validité des documents réglementaires.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le suivi des modifications Compagnie en analysant la documentation constructeur et des AD/CN (DT 57). Il aura en charge le suivi de la réalisation des travaux demandés.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’interface privilégié : en qualité de référent technique, le titulaire est en relation avec les services officiels et pourra être amené à être le représentant ASL Airlines France sur un chantier externalisé.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le standard technique en gérant et mettant à jour le standard technique des ATA.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le suivi opérationnel de la flotte en apportant des solutions aux problèmes techniques.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’agent Structure Cabine sera le correspondant Fiabilité.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il assurera la gestion globale de la fiabilité B737 (réduction des coûts d’entretien et amélioration de la qualité de service) et rédigera les rapports mensuels et annuels de Fiabilité.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d’un BTS avec expérience, IMA ou niveau équivalent d’expérience sanctionné par une évaluation.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une expérience de bureau technique, production ou contrôle affirmée.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance de la réglementation dans ses différentes composantes (IROps, PART M, PART 145, PART 21.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon niveau d’anglais et pratiquez l’anglais technique régulièrement.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes reconnu pour votre autonomie, votre sens de l’organisation et votre rigueur.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous appréciez de travailler en équipe.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Votre disponibilité et votre réactivité seront des atouts majeurs dans la gestion de projets.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 0, '2017-08-21', 61);
INSERT INTO `offers` VALUES (177, 'Agent Technique Spécialité Moteur', 1, 2, '', '2017-10-24', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché à la Direction Technique, le titulaire garantit l\'existence et la fourniture d\'informations techniques concourant à assurer la navigabilité des éléments de ses zones ATA et la réalisation selon les standards de qualité de la Compagnie des travaux confiés aux ateliers PART 145 et aux sous-traitants.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il a pour missions :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De répondre à toutes questions techniques du PN en tant que spécialiste technique de la Compagnie dans sa zone ATA</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- D\'assurer le suivi des documents réglementaires et des modifications Compagnie</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De gérer et mettre à jour le standard technique de ses ATA (Equipements ou modifications fonctionnelles).&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De suivre le dépannage des équipements</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- De mettre à jour le programme d’entretien et de mesurer son efficacité</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- D\'élaborer le budget des travaux de sa zone ATA et suit le budget arrêté.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L\'Agent Technique Moteurs doit être capable de réaliser les taches suivantes :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Définition des workscopes moteurs (technique et économique)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Suivi in situ des shops visites et des restitutions de moteurs de location (déplacement sur site pouvant aller jusqu’ à 2 semaines)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etude du trend monitoring et optimisation des marges EGT</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Selon planning, participation in situ (étranger) à l’acceptation des moteurs d’avions en phase in.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Recherche d’admissibilité du dommage et de solution de dispatch dans la documentation constructeur.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Communication avec le constructeur (TC Holder)&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Suivi de navigabilité : traitement des AD, SB et SL Moteurs&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Assistance au service logistique&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Diplômé(e) d\'une licence avec expérience, de l\'IMA ou niveau équivalent d’expérience sanctionné par une évaluation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une expérience de bureau technique, production ou contrôle affirmée</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous pratiquez l’anglais technique et avez une conversation de bon niveau</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance de l\'environnement Windows et pratique des environnements informatiques (TRAX, AMASYS, AMOS)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance de la réglementation dans ses différentes composantes (IROps, PART M, PART 145, PART 21)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes autonome, disponible et réactif(ve)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes doté(e) d\'un bon sens du travail en équipe et de l\'organisation. Vous avez une bonne capacité à gérer des projets.</span><br></p>', NULL, 0, '2017-10-24', 61);
INSERT INTO `offers` VALUES (178, 'Stage à la Direction Commerciale', 1, 5, '6', '2018-02-01', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au service Ventes de la Direction Commerciale et du Programme, vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Démarches commerciales :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Développer la politique de prospection et d’acquisition de nouveaux marchés dans le transport aérien de passagers et de fret</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Effectuer des recherches de fonds sur les prospects pouvant être contactés</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Identifier les individus clés au sein des entreprises prospectes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Utiliser l’ensemble des outils mis à disposition (microsoft dynamics, icotour, recherches web)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Actions commerciales « opérationnelles » :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Réponses aux diverses demandes des clients</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Utilisation de l’outil de cotation ASL Airlines France</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etablissement d’offres commerciales</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Études commerciales et marketing :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etudes de lignes aériennes</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Études et veille concurrentielle : diagnostic sur l\'environnement et les concurrents.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Etudes tarifaires</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous êtes en École de Commerce / Université</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous préparez un Master</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Vous êtes passionné(e) par l’aérien</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une bonne maîtrise du pack Office</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une bonne maîtrise de l\'anglais - Etre détenteur du TOEIC (score minimum 750)</span><br></p>', NULL, 0, '2017-12-12', 61);
INSERT INTO `offers` VALUES (179, 'Technicien(ne) avion B1 et/ou B2', 1, 1, '9', '2018-03-01', 1, '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Assurer la conduite des dépannages sur Roissy-CDG et éventuellement en escale, dans le respect des normes de navigabilité.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la maintenance programmée.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la préparation logistique des travaux de rectification programmés.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la saisie informatique des travaux exécutés.</li></ul>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Diplôme reconnu pour l\'exercice du métier de mécanicien en aéronautique.</li><li style=\"margin: 0px; padding: 0px;\">Titulaire de la licence Part 66.</li><li style=\"margin: 0px; padding: 0px;\">Connaissances et expérience B737 Classic et&nbsp;Next Generation&nbsp;(avec qualification de type).</li><li style=\"margin: 0px; padding: 0px;\">5 ans minimum d\'expérience sur un avion à réacteur de masse supérieure à 5,7 tonnes.</li><li style=\"margin: 0px; padding: 0px;\">Pratique de la documentation constructeur.</li><li style=\"margin: 0px; padding: 0px;\">Pratique de l\'anglais technique.</li></ul><p><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"></p>', NULL, 1, '2017-12-21', 61);
INSERT INTO `offers` VALUES (180, 'Technicien(ne) avion B1 confirmé(e)', 1, 2, '', '2017-12-21', 1, '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px; padding-left: 20px !important; list-style-position: initial !important; list-style-image: initial !important;\"><li style=\"margin: 0px; padding: 0px;\">Assurer la conduite des dépannages sur Roissy-CDG et éventuellement en escale, dans le respect des normes de navigabilité.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la maintenance programmée.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la préparation logistique des travaux de rectification programmés.</li><li style=\"margin: 0px; padding: 0px;\">Assurer la saisie informatique des travaux exécutés.</li></ul>', '<li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Diplôme reconnu pour l\'exercice du métier de mécanicien en aéronautique.</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire de la licence Part 66.</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Connaissances et expérience B737 Classic et&nbsp;Next Generation&nbsp;(avec qualification de type).</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">5 ans minimum d\'expérience sur un avion à réacteur de masse supérieure à 5,7 tonnes.</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Pratique de la documentation constructeur.</li><li style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Pratique de l\'anglais technique.</li>', NULL, 1, '2017-12-21', 61);
INSERT INTO `offers` VALUES (181, 'Superviseur Escale', 1, 2, '', '2017-12-21', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Responsable d\'Escale de CDG, vous procédez à la supervision de l\'exploitation et au suivi de l\'ensemble des vols du réseau Cargo et Passager.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans ce cadre, vous veillez au respect des consignes et procédures transmises à nos assistances en vue de la réalisation de leurs prestations, et au respect des différentes contraintes (horaires, sécurité, sûreté...) affectant les touchées.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous assurez la supervision de tous les intervenants de la touchée et vous assurez le suivi de toutes les opérations en escale sur l\'ensemble du réseau.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">De formation Bac+2, vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec les intervenants.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous saurez faire preuve de réactivité, de maîtrise de soi, d\'adaptabilité et avez le sens de l\'organisation.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un bon relationnel et vous disposez d\'un bon esprit d’équipe.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><font face=\"Verdana, Geneva, Arial, Helvetica, sans-serif\"><span style=\"font-size: 11px;\">Vous maîtrisez&nbsp;l\'anglais.</span></font><br></p>', NULL, 0, '2017-12-21', 61);
INSERT INTO `offers` VALUES (182, 'Responsable planning', 1, 2, '', '2018-03-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans le cadre réglementaire et en fonction des textes régissant le régime de travail des PN de l’entreprise, le titulaire programme les activités aériennes et non-aériennes de l’ensemble du personnel navigant.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire a pour principales missions:</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Superviser l’affectation, selon les règles d’utilisation en vigueur, du PN nécessaire à la réalisation des vols.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Garantir une programmation équitable entre chacun des PN d’une même catégorie.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Veiller au respect des délais de production et à la réalisation des objectifs de qualité.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Manager et Encadrer le travail des agents de planning.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<div class=\"table_admin_body\" style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.938px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez de bonnes connaissances de la réglementation de l\'activité des PN</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez une première expérience d\'agent de planning/régulation</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec le Personnel Navigant.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez le sens de la rigueur et de l\'organisation.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez d\'excellentes qualités d\'analyses et de gestion de projet.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous êtes pédagogue, patient, réactif et disponible.</span><br></div>', NULL, 0, '2018-03-13', 61);
INSERT INTO `offers` VALUES (183, 'Chargé(e) Réglementations', 1, 2, '', '2018-03-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le Chargé(e) règlementations est placé sous l’autorité directe du Responsable Qualité et Sécurité - IR OPS pour ce qui concerne la définition et la mise en œuvre des règlementations aéronautiques de la compagnie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le Chargé(e) règlementations réalise :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une veille des évolutions règlementaires liées à la conformité dans le domaine aéronautique ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’élaboration et la mise à jour des procédures relatives aux règlementations AIROPS, AIRCREW, sous parties G et I de la sous partie M et Part 145 ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La mise en œuvre des plannings d’audits AIROPS, AIRCREW, sous parties G et I de la sous partie M et Part 145 ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La vérification de la conformité des évolutions documentaires associées aux règlementations AIROPS, AIRCREW, sous parties G et I de la sous partie M et Part 145 avant validation par le Responsable Qualité et Sécurité - IR OPS et envoi aux autorités pour approbation ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le suivi des actions préventives et correctives et la mesure de leur efficacité ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Les enregistrements liés à la conformité dans le logiciel Performance en Ligne ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le traitement des retours d’expérience et s’assurer de leur pertinence ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La préparation des revues périodiques de conformité.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le Chargé(e) règlementations participe à l’analyse des risques associés aux changements et évolutions de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance des normes réglementaires.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes à l\'aise dans l’expression écrite et la communication orale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un esprit de synthèse, d\'analyse et le sens des priorités.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes méthodique, rigoureux(se) et organisé(e), autonome, adaptable.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous sommes une compagnie aérienne située dans la zone de Cargo 9 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span><br></p>', NULL, 0, '2018-03-13', 61);
INSERT INTO `offers` VALUES (184, 'Analyste - Revenue Management Pricing', 1, 2, '', '2018-03-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L\'analyste - revenue management pricing accompagne le développement de l’activité «passagers» et «fret» de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire assure l’étude du marché de transport aérien et aide à la décision quant à l’évolution de l’offre.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il garantit la satisfaction des clients en mettant en place les produits adéquats dont il assure la promotion, l’aboutissement des projets dont il a la charge. Pour cela, il paramètre les outils de revenue management à disposition de façon optimale et la disponibilité des classes de réservation.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il veille au respect des procédures Qualité au sein de la Direction Commerciale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Il effectue une veille tarifaire de la concurrence, définit les niveaux et conditions tarifaires optimales, et gère les produits tarifaires ; publie les tarifs et liaison avec les prestataires externes.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Le titulaire est une personne capable de piloter notre amélioration, innovation et évolution.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d\'un bac +4/5 d\'une école d\'ingénieur ou de commerce.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous pratiquez l’anglais couramment.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez de bonnes connaissances du marché et de l’environnement de l’activité de transport aérien.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous disposez de connaissances techniques opérationnelles et des logiciels informatiques tels que Amadeus/Travelport.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une première expérience dans une compagnie aérienne.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes une personne autonome, disponible, rigoureuse, organisée et réactive.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes doté(e) d\'un esprit logique, d\'analyse et d’équipe.</span><br></p>', NULL, 0, '2018-03-13', 61);
INSERT INTO `offers` VALUES (185, 'Agent de planning', 1, 1, '7 (minimum)', '2018-03-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Responsable Planning, vous procédez à la planification des immobilisations et des activités aériennes du Personnel Navigant Technique et Commercial de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Dans ce cadre, vous élaborez les tours de service du Personnel Navigant en fonction de la charge-programme et du niveau des immobilisations déterminé dans le respect des textes régissant le régime de travail du Personnel Navigant de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous en assurez le suivi opérationnel et pouvez être amené à prendre toutes les mesures de modification de l’activité pré-établie.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’activité est organisée en horaires décalés selon un emploi du temps pré-établi.</span><br></p>', '<div class=\"table_admin_body\" style=\"margin: 0px 20px; padding: 0px; overflow: auto; width: 684.938px; color: rgb(102, 102, 102); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">De formation Bac+2, Technico commercial, Gestion, Ordonnancement ou Logistique, vous saurez faire preuve de qualités d’écoute et de dialogue dans vos relations avec le Personnel Navigant.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez une première expérience dans une compagnie aérienne.</span><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><br style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Geneva, Arial, Helvetica, sans-serif;\">Vous avez le sens de la rigueur, de l\'organisation et du travail en équipe.</span><br></div>', NULL, 0, '2018-03-13', 61);
INSERT INTO `offers` VALUES (186, 'Adjoint Resp. Conformité et Sécurité - IR OPS', 1, 2, '', '2018-03-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e)au Responsable Conformité et Sécurité - IR OPS, L\'Adjoint Responsable Conformité et Sécurité - IR OPS met en œuvre le Système Sécurité et conformité de la compagnie conformément à la réglementation AIROPS en vigueur.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’Adjoint Responsable Conformité et Sécurité - IR OPS participe à :&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Pilotage et suivi des activités liées au Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La mise en place des mécanismes de vérification.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’animation et la coordination des activités liées au Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’organisation des retours d’expérience et vérification de leur pertinence;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La préparation et l’organisation des revues de sécurité et de conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La promotion du Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• A la mise en œuvre des mesures dans le cadre du suivi des indicateurs de sécurité, de l’analyse des événements, des audits internes, de l’évaluation des modifications, de la gestion des risques, des revues de sécurité/conformité ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• A l’analyse des risques associés aux changements et évolutions de l’entreprise.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">L’Adjoint Responsable Conformité et Sécurité - IR OPS réalise :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Les audits internes de conformité dans les différents services concernés par les activités liées au Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La vérification de l’efficacité des mesures préventives et correctives prises dans les différents domaines;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Une veille documentaire liée à la sécurité/conformité dans le domaine aéronautique.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’élaboration et la mise à jour des procédures relatives au fonctionnement du Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• L’enregistrement des éléments du Système sécurité et conformité dans le logiciel Performance en Ligne;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La diffusion à tous niveaux des informations liées au Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• A l’élaboration des comptes rendus des revues périodiques du Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• Le suivi de la mise en œuvre des mesures préventives et correctives liées au Système sécurité et conformité;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• A l’analyse d’une profondeur adaptée à son niveau de gravité de tous les événements détectés,</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La mise en œuvre des moyens de formation au Système sécurité et conformité adaptés et pertinents par rapport à l’entreprise ;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">• La vérification de l’efficacité des mesures préventives et correctives prises dans les différents domaines.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Ces différentes missions ne sont pas exhaustives et sont susceptibles d’être modifiées en fonction des évolutions et de l’adaptation de l’activité de la Compagnie.</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une bonne connaissance des normes réglementaires, management, structure organisationnelle de la compagnie et une expérience impérative dans le secteur aérien.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes à l\'aise dans l’expression écrite et la communication orale.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez un esprit de synthèse, d\'analyse et le sens des priorités.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous êtes méthodique, rigoureux(se) et organisé(e), autonome et disponible.&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Nous sommes une compagnie aérienne située dans la zone de Cargo 9 de Roissy Charles de Gaulle, un véhicule est donc indispensable pour se rendre dans nos locaux.</span><br></p>', NULL, 0, '2018-03-13', 61);
INSERT INTO `offers` VALUES (187, 'Chargé(e) de Communication', 1, 1, '5-6', '2018-04-13', 1, '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Rattaché(e) au Service Communication de la Direction Générale, vos missions s’articuleront autour des domaines suivants :</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Gestion du budget communication en relation avec le service comptabilité.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Rédiger les news pour l’intranet et pages destinations du site internet</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Mettre à jour le site internet sur Wordpress</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Mise en ligne d’informations dans l’intranet&nbsp;</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Mise en page des flash qualité de service hebdomadaires et mensuels</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Création de bannières, de flyers B2B, B2C, de brochures, de visuels pour les réseaux sociaux et tout support de communication en collaboration avec la graphiste du service, maquette cartes de visite</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer l’organisation et le suivi logistique des évènements internes et externes : soirée clients, salon Top Résa, vœux du Directeur général, réunion cadres.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Assurer le suivi des commandes d’objets promotionnels : commandes fournisseurs, commandes des directions et du personnel.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Prise de photos pour l’organigramme et participation éventuelle à des reportages à bord des appareils.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">- Projet 2018 : création d’un site internet B2C</span><br></p>', '<p><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Titulaire d’un BAC +3/+5 et impérativement diplômé d\'une école de communication</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une expérience d’au moins 3 ans</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous avez une excellente maîtrise des outils PAO</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Vous disposez de qualités rédactionnelles avec une bonne orthographe.</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Gestion des priorités</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Gestion de projet</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Anglais courant</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Des compétences en webdesign et After Effect seraient un plus</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Très bon relationnel, Dynamique, Réfléchi(e)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Capacité d’adaptation</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Esprit d\'équipe</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Polyvalent</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Organisé(e)</span><br style=\"margin: 0px; padding: 0px; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\"><span style=\"font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 11px;\">Créatif</span><br></p>', NULL, 0, '2018-04-13', 61);
